INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735244', '511145.b0014', '511145', 'chaperone HSP70, co-chaperone with DnaJ; Plays an essential role in the initiation of phage lambda DNA replication, where it acts in an ATP-dependent fashion with the dnaJ protein to release lambda O and P proteins from the preprimosomal complex. DnaK is also involved in chromosomal DNA replication, possibly through an analogous interaction with the dnaA protein. Also participates actively in the response to hyperosmotic shock', 'dnaK');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735245', '511145.b0015', '511145', 'chaperone HSP40, co-chaperone with DnaK; Interacts with dnaK and grpE to disassemble a protein complex at the origins of replication of phage lambda and several plasmids. Participates actively in the response to hyperosmotic and heat shock by preventing the aggregation of stress-denatured proteins and by disaggregating proteins, also in an autonomous, dnaK-independent fashion. Unfolded proteins bind initially to dnaJ; upon interaction with the dnaJ-bound protein, dnaK hydrolyzes its bound ATP, resulting in the formation of a stable complex. GrpE releases ADP from dnaK; ATP binding to d [...] ', 'dnaJ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735246', '511145.b0016', '511145', 'IS186/IS421 transposase', 'b0016');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735247', '511145.b0018', '511145', 'toxic membrane protein, small; When overexpressed, kills the cells from the inside by interfering with a vital function in the cell membrane', 'hokC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735248', '511145.b0019', '511145', 'sodium-proton antiporter; Na(+)/H(+) antiporter that extrudes sodium in exchange for external protons. Catalyzes the exchange of 2 H(+) per Na(+). Can mediate sodium uptake when a transmembrane pH gradient is applied. Active at alkaline pH. Activity is strongly down- regulated below pH 6.5', 'nhaA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735249', '511145.b0020', '511145', 'DNA-binding transcriptional activator; Plays a role in the positive regulation of nhaA', 'nhaR');
