INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735252', '511145.b0023', '511145', '30S ribosomal subunit protein S20; Binds directly to 16S ribosomal RNA', 'rpsT');
