INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735255', '511145.b0026', '511145', 'isoleucyl-tRNA synthetase; Catalyzes the attachment of isoleucine to tRNA(Ile). As IleRS can inadvertently accommodate and process structurally similar amino acids such as valine, to avoid such errors it has two additional distinct tRNA(Ile)-dependent editing activities. One activity is designated as ''pretransfer'' editing and involves the hydrolysis of activated Val-AMP. The other activity is designated ''posttransfer'' editing and involves deacylation of mischarged Val-tRNA(Ile)', 'ileS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735256', '511145.b0027', '511145', 'prolipoprotein signal peptidase (signal peptidase II); This protein specifically catalyzes the removal of signal peptides from prolipoproteins (By similarity)', 'lspA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735257', '511145.b0028', '511145', 'FKBP-type peptidyl-prolyl cis-trans isomerase (rotamase); PPIases accelerate the folding of proteins. Substrate specificity carried out with ''Suc-Ala-Xaa-Pro-Phe-4-nitroanilide'', where Xaa is the amino acid tested, was found to be Phe > Leu >> Ile > Lys = Ala > Trp > His >> Gln', 'fkpB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735258', '511145.b0029', '511145', '1-hydroxy-2-methyl-2-(E)-butenyl 4-diphosphate reductase, 4Fe-4S protein; Converts 1-hydroxy-2-methyl-2-(E)-butenyl 4-diphosphate into isopentenyl diphosphate (IPP) and dimethylallyl diphosphate (DMAPP). Is also involved in penicillin tolerance and control of the stringent response. Seems to directly or indirectly interact with relA to maintain it in an inactive form during normal growth', 'ispH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735259', '511145.b0030', '511145', 'ribonucleoside hydrolase 3; Hydrolyzes both purine and pyrimidine ribonucleosides with a broad-substrate specificity with decreasing activity in the order uridine, xanthosine, inosine, adenosine, cytidine, guanosine', 'rihC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735260', '511145.b0031', '511145', 'dihydrodipicolinate reductase', 'dapB');
