INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735265', '511145.b0036', '511145', 'crotonobetainyl CoA hydratase; Catalyzes the reversible dehydration of L-carnitinyl-CoA to crotonobetainyl-CoA', 'caiD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735266', '511145.b0037', '511145', 'predicted crotonobetaine CoA ligase:carnitine CoA ligase; Could catalyze the transfer of CoA to carnitine, generating the initial carnitinyl-CoA needed for the caiB reaction cycle', 'caiC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735267', '511145.b0038', '511145', 'crotonobetainyl CoA:carnitine CoA transferase; Catalyzes the reversible transfer of the CoA moiety from gamma-butyrobetainyl-CoA to L-carnitine to generate L-carnitinyl- CoA and gamma-butyrobetaine. Is also able to catalyze the reversible transfer of the CoA moiety from gamma-butyrobetainyl- CoA or L-carnitinyl-CoA to crotonobetaine to generate crotonobetainyl-CoA', 'caiB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735268', '511145.b0039', '511145', 'crotonobetaine reductase subunit II, FAD-binding; Catalyzes the reduction of crotonobetainyl-CoA to gamma- butyrobetainyl-CoA', 'caiA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735269', '511145.b0040', '511145', 'predicted transporter; Catalyzes the exchange of L-carnitine for gamma- butyrobetaine and related betaines', 'caiT');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735270', '511145.b0041', '511145', 'predicted electron transfer flavoprotein subunit, ETFP adenine nucleotide-binding domain; Required for anaerobic carnitine reduction. May bring reductant to caiA', 'fixA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735271', '511145.b0042', '511145', 'predicted electron transfer flavoprotein, NAD/FAD-binding domain and ETFP adenine nucleotide-binding domain-like; Required for anaerobic carnitine reduction. May bring reductant to caiA', 'fixB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735272', '511145.b0043', '511145', 'predicted oxidoreductase with FAD/NAD(P)-binding domain; Could be part of an electron transfer system required for anaerobic carnitine reduction', 'fixC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735273', '511145.b0044', '511145', 'predicted 4Fe-4S ferredoxin-type protein; Could be part of an electron transfer system required for anaerobic carnitine reduction. Could be a 3Fe-4S cluster- containing protein', 'fixX');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735274', '511145.b0045', '511145', 'predicted transporter', 'yaaU');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735275', '511145.b0046', '511145', 'flavoprotein subunit for the KefC potassium efflux system; Required for full activity of kefC', 'kefF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735276', '511145.b0047', '511145', 'potassium:proton antiporter; Transport system that facilitates potassium-efflux, possibly by potassium-proton antiport (By similarity)', 'kefC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735277', '511145.b0048', '511145', 'dihydrofolate reductase', 'folA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735278', '511145.b0049', '511145', 'diadenosine tetraphosphatase; Hydrolyzes diadenosine 5'',5''''''-P1,P4-tetraphosphate to yield ADP (By similarity)', 'apaH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735279', '511145.b0050', '511145', 'protein associated with Co2+ and Mg2+ efflux', 'apaG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735280', '511145.b0051', '511145', 'S-adenosylmethionine-6-N'',N''-adenosyl (rRNA) dimethyltransferase; Specifically dimethylates two adjacent adenosines (A1518 and A1519) in the loop of a conserved hairpin near the 3''-end of 16S rRNA in the 30S particle. May play a critical role in biogenesis of 30S subunits. Has also a DNA glycosylase/AP lyase activity that removes C mispaired with oxidized T from DNA, and may play a role in protection of DNA against oxidative stress', 'ksgA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735281', '511145.b0052', '511145', '4-hydroxy-L-threonine phosphate dehydrogenase, NAD-dependent; Catalyzes the NAD(P)-dependent oxidation of 4- (phosphohydroxy)-L-threonine (HTP) into 2-amino-3-oxo-4- (phosphohydroxy)butyric acid which spontaneously decarboxylates to form 3-amino-2-oxopropyl phosphate (AHAP)', 'pdxA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735282', '511145.b0053', '511145', 'peptidyl-prolyl cis-trans isomerase (PPIase); Chaperone involved in the correct folding and assembly of outer membrane proteins, such as ompA, ompF and lamB. It recognizes specific patterns of aromatic residues and the orientation of their side chains, which are found more frequently in integral outer membrane proteins. May act in both early periplasmic and late outer membrane-associated steps of protein maturation. Essential for the survival of E.coli in stationary phase. Required for pilus biogenesis', 'surA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735283', '511145.b0054', '511145', 'LPS assembly OM complex LptDE, beta-barrel component; Together with lptE, is involved in the assembly of LPS in the outer leaflet of the outer membrane. Determines N-hexane tolerance and is involved in outer membrane permeability. Essential for envelope biogenesis (By similarity)', 'lptD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735299', '511145.b0072', '511145', '3-isopropylmalate dehydratase large subunit (EC:4.2.1.33); Catalyzes the isomerization between 2-isopropylmalate and 3-isopropylmalate, via the formation of 2-isopropylmaleate', 'leuC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735700', '511145.b0515', '511145', 'conserved protein', 'ylbA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735284', '511145.b0055', '511145', 'DnaJ-like protein, membrane anchored; Regulatory dnaK co-chaperone. Direct interaction between dnaK and djlA is needed for the induction of the wcaABCDE operon, involved in the synthesis of a colanic acid polysaccharide capsule, possibly through activation of the rcsB/rcsC phosphotransfer signaling pathway. The colanic acid capsule may help the bacterium survive conditions outside the host', 'djlA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735285', '511145.b0058', '511145', 'pseudouridine synthase for 23S rRNA (position 746) and tRNAphe(position 32); Responsible for synthesis of pseudouridine from uracil- 746 in 23S ribosomal RNA and from uracil-32 in the anticodon stem and loop of transfer RNAs', 'rluA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735286', '511145.b0059', '511145', 'RNA polymerase-associated helicase protein (ATPase and RNA polymerase recycling factor); Transcription regulator that activates transcription by stimulating RNA polymerase (RNAP) recycling in case of stress conditions such as supercoiled DNA or high salt concentrations. Probably acts by releasing the RNAP, when it is trapped or immobilized on tightly supercoiled DNA. Does not activate transcription on linear DNA. Probably not involved in DNA repair (By similarity)', 'rapA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735287', '511145.b0060', '511145', 'DNA polymerase II; Thought to be involved in DNA repair and/or mutagenesis', 'polB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735288', '511145.b0061', '511145', 'L-ribulose-5-phosphate 4-epimerase', 'araD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735289', '511145.b0062', '511145', 'L-arabinose isomerase; Catalyzes the conversion of L-arabinose to L-ribulose (By similarity)', 'araA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735290', '511145.b0063', '511145', 'L-ribulokinase', 'araB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735291', '511145.b0064', '511145', 'DNA-binding transcriptional dual regulator; This protein controls the expression of at least six genes that are involved in the transport and catabolism of L- arabinose. It regulates initiation of transcription of the araBAD operon and it also controls its own synthesis. The L-arabinose operon displays both positive and negative regulation through araC', 'araC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735292', '511145.b0065', '511145', 'conserved inner membrane protein', 'yabI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735293', '511145.b0066', '511145', 'thiamin transporter subunit; Part of the ABC transporter complex thiBPQ involved in thiamine import. Responsible for energy coupling to the transport system (Probable)', 'thiQ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735294', '511145.b0067', '511145', 'fused thiamin transporter subunits of ABC superfamily: membrane components; Part of the ABC transporter complex thiBPQ involved in thiamine import. Probably responsible for the translocation of the substrate across the membrane', 'thiP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735295', '511145.b0068', '511145', 'thiamin transporter subunit; Part of the ABC transporter complex thiBPQ involved in thiamine import', 'thiB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735296', '511145.b0069', '511145', 'DNA-binding transcriptional regulator; Activates the small RNA gene sgrS under glucose- phosphate stress conditions as well as yfdZ. Represses its own transcription under both stress and non-stress conditions; this repression likely provides one measure of control over sgrR at the level of synthesis. Might act as a sensor of the intracellular accumulation of phosphoglucose by binding these molecules in its C-terminal solute-binding domain', 'sgrR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735297', '511145.b0070', '511145', 'broad specificity sugar efflux system; Involved in the efflux of sugars. The physiological role may be the detoxification of non-metabolizable sugar analogs. Can transport IPTG, lactose and glucose. Has broad substrate specificity, with preferences for glucosides or galactosides with alkyl or aryl substituents', 'setA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735298', '511145.b0071', '511145', '3-isopropylmalate isomerase subunit; Catalyzes the isomerization between 2-isopropylmalate and 3-isopropylmalate, via the formation of 2-isopropylmaleate', 'leuD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735300', '511145.b0073', '511145', '3-isopropylmalate dehydrogenase; Catalyzes the oxidation of 3-carboxy-2-hydroxy-4- methylpentanoate (3-isopropylmalate) to 3-carboxy-4-methyl-2- oxopentanoate. The product decarboxylates to 4-methyl-2 oxopentanoate (By similarity)', 'leuB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735301', '511145.b0074', '511145', '2-isopropylmalate synthase; Catalyzes the condensation of the acetyl group of acetyl-CoA with 3-methyl-2-oxobutanoate (2-oxoisovalerate) to form 3-carboxy-3-hydroxy-4-methylpentanoate (2-isopropylmalate) (By similarity)', 'leuA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735302', '511145.b0075', '511145', 'leu operon leader peptide; Involved in control of the biosynthesis of leucine', 'leuL');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735303', '511145.b0076', '511145', 'DNA-binding transcriptional activator', 'leuO');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735304', '511145.b0077', '511145', 'acetolactate synthase III, large subunit', 'ilvI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735305', '511145.b0078', '511145', 'acetolactate synthase III, thiamin-dependent, small subunit', 'ilvH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735306', '511145.b0080', '511145', 'DNA-binding transcriptional dual regulator; Represses some operons but activates others. It is implicated in the regulation of a large number of operons encoding enzymes which comprise central pathways of carbon metabolism. Binds D-fructose as an inducer', 'fruR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735307', '511145.b0081', '511145', 'conserved protein', 'mraZ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735308', '511145.b0082', '511145', '16S rRNA m(4)C1402 methyltranserfase, SAM-dependent (EC:2.1.1.-); Exhibits S-adenosyl-L-methionine-dependent methyltransferase activity', 'mraW');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735309', '511145.b0083', '511145', 'membrane bound cell division protein at septum containing leucine zipper motif; Protein involved in cell division and cell growth. May play some role in coupling cell division and peptidoglycan physiology', 'ftsL');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735310', '511145.b0084', '511145', 'transpeptidase involved in septal peptidoglycan synthesis (penicillin-binding protein 3); Cell wall formation. Essential for the formation of a septum of the murein sacculus. Synthesis of cross-linked peptidoglycan from the lipid intermediates', 'ftsI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735311', '511145.b0085', '511145', 'UDP-N-acetylmuramoyl-L-alanyl-D-glutamate:meso- diaminopimelate ligase; Catalyzes the addition of meso-diaminopimelic acid to the nucleotide precursor UDP-N-acetylmuramoyl-L-alanyl-D-glutamate (UMAG) in the biosynthesis of bacterial cell-wall peptidoglycan. Is also able to use many meso-diaminopimelate analogs as substrates, although much less efficiently, but not L-lysine', 'murE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735312', '511145.b0086', '511145', 'UDP-N-acetylmuramoyl-tripeptide:D-alanyl-D- alanine ligase; Involved in cell wall formation. Catalyzes the final step in the synthesis of UDP-N-acetylmuramoyl-pentapeptide, the precursor of murein (By similarity)', 'murF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735313', '511145.b0087', '511145', 'phospho-N-acetylmuramoyl-pentapeptide transferase; First step of the lipid cycle reactions in the biosynthesis of the cell wall peptidoglycan', 'mraY');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735314', '511145.b0088', '511145', 'UDP-N-acetylmuramoyl-L-alanine:D-glutamate ligase; Cell wall formation. Catalyzes the addition of glutamate to the nucleotide precursor UDP-N-acetylmuramoyl-L-alanine (UMA) (By similarity)', 'murD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735315', '511145.b0089', '511145', 'integral membrane protein involved in stabilizing FstZ ring during cell division; This is a septum-peptidoglycan biosynthetic protein, involved in cell wall formation. Plays a role in the stabilization of the ftsZ ring during cell division', 'ftsW');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735479', '511145.b0274', '511145', 'IS1 transposase B; Absolutely required for transposition of IS1', 'aec38');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735316', '511145.b0090', '511145', 'N-acetylglucosaminyl transferase; Cell wall formation. Catalyzes the transfer of a GlcNAc subunit on undecaprenyl-pyrophosphoryl-MurNAc-pentapeptide (lipid intermediate I) to form undecaprenyl-pyrophosphoryl-MurNAc- (pentapeptide)GlcNAc (lipid intermediate II)', 'murG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735317', '511145.b0091', '511145', 'UDP-N-acetylmuramate:L-alanine ligase; Cell wall formation', 'murC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735318', '511145.b0092', '511145', 'D-alanine:D-alanine ligase; Cell wall formation', 'ddlB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735319', '511145.b0093', '511145', 'membrane anchored protein involved in growth of wall at septum; This protein may be involved in septum formation', 'ftsQ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735320', '511145.b0094', '511145', 'ATP-binding cell division protein involved in recruitment of FtsK to Z ring; This protein may be involved in anomalous filament growth (By similarity). May be a component of the septum', 'ftsA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735321', '511145.b0095', '511145', 'GTP-binding tubulin-like cell division protein; This protein is essential to the cell-division process. It seems to assemble into a dynamic ring on the inner surface of the cytoplasmic membrane at the place where division will occur, and the formation of the ring is the signal for septation to begin. Binds to and hydrolyzes GTP. Involved in the synthesis of the septal peptidoglycan', 'ftsZ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735322', '511145.b0096', '511145', 'UDP-3-O-acyl N-acetylglucosamine deacetylase; Involved in the biosynthesis of lipid A, a phosphorylated glycolipid that anchors the lipopolysaccharide to the outer membrane of the cell', 'lpxC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735323', '511145.b0097', '511145', 'regulator of SecA translation; Regulates secA expression by translational coupling of the secM secA operon. Ribosomes translating the C-terminal region of secM can disrupt an RNA repressor helix that normally blocks secA translation initiation, derepressing the expression of secA. Translational pausing of secM at Pro-166 under secretion-limiting conditions increases the duration of the disruption and thus increases secA expression. This is controlled by interaction of the secM signal peptide with secA and the translocon, possibly by secA pulling the paused secM out of the ribosome. The [...] ', 'secM');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735324', '511145.b0098', '511145', 'preprotein translocase subunit, ATPase; Required for protein export, interacts with the secYEG preprotein conducting channel. SecA has a central role in coupling the hydrolysis of ATP to the transfer of proteins into and across the cell membrane, serving both as a receptor for the preprotein- secB complex and as an ATP-driven molecular motor driving the stepwise translocation of polypeptide chains across the membrane', 'secA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735325', '511145.b0099', '511145', 'nucleoside triphosphate pyrophosphohydrolase, marked preference for dGTP; Involved in the GO system responsible for removing an oxidatively damaged form of guanine (7,8-dihydro-8-oxoguanine) from DNA and the nucleotide pool. 8-oxo-dGTP is inserted opposite dA and dC residues of template DNA with almost equal efficiency thus leading to A.T to G.C transversions. MutT specifically degrades 8-oxo-dGTP to the monophosphate', 'mutT');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735326', '511145.b0101', '511145', 'DNA gyrase inhibitor', 'yacG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735327', '511145.b0102', '511145', 'conserved protein', 'yacF');
