INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735429', '511145.b0212', '511145', 'hydroxyacylglutathione hydrolase; Thiolesterase that catalyzes the hydrolysis of S-D- lactoyl-glutathione to form glutathione and D-lactic acid', 'gloB');
