INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735334', '511145.b0110', '511145', 'N-acetyl-anhydromuranmyl-L-alanine amidase; Involved in both cell wall peptidoglycans recycling and beta-lactamase induction. Specifically cleaves the amide bond between the lactyl group of N-acetylmuramic acid and the alpha- amino group of the L-alanine in degradation products containing an anhydro N-acetylmuramyl moiety (By similarity)', 'ampD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735335', '511145.b0111', '511145', 'predicted inner membrane protein; Putative signaling protein in beta-lactamase regulation. AmpE seems not to act as a direct sensor for beta-lactams', 'ampE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735336', '511145.b0112', '511145', 'aromatic amino acid transporter; Permease that is involved in the transport across the cytoplasmic membrane of the aromatic amino acids (phenylalanine, tyrosine, and tryptophan)', 'aroP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735337', '511145.b0113', '511145', 'DNA-binding transcriptional dual regulator; Transcriptional repressor for the pyruvate dehydrogenase complex genes aceEF and lpd', 'pdhR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735338', '511145.b0114', '511145', 'pyruvate dehydrogenase, decarboxylase component E1, thiamin-binding; The pyruvate dehydrogenase complex catalyzes the overall conversion of pyruvate to acetyl-CoA and CO(2). It contains multiple copies of three enzymatic components: pyruvate dehydrogenase (E1), dihydrolipoamide acetyltransferase (E2) and lipoamide dehydrogenase (E3)', 'aceE');
