INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735340', '511145.b0116', '511145', 'lipoamide dehydrogenase, E3 component is part of three enzyme complexes; Lipoamide dehydrogenase is a component of the glycine cleavage system as well as of the alpha-ketoacid dehydrogenase complexes', 'lpdA');
