INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735344', '511145.b0120', '511145', 'S-adenosylmethionine decarboxylase; Catalyzes the decarboxylation of S-adenosylmethionine to S-adenosylmethioninamine (dcAdoMet), the propylamine donor required for the synthesis of the polyamines spermine and spermidine from the diamine putrescine (By similarity)', 'speD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735345', '511145.b0121', '511145', 'spermidine synthase (putrescine aminopropyltransferase); Catalyzes the production of spermidine from putrescine and decarboxylated S-adenosylmethionine (dcSAM), which serves as an aminopropyl donor', 'speE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735346', '511145.b0122', '511145', 'predicted protein', 'yacC');
