INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735347', '511145.b0123', '511145', 'multicopper oxidase (laccase); Probably involved in periplasmic detoxification of copper by oxidizing Cu(+) to Cu(2+) and thus preventing its uptake into the cytoplasm. Possesses phenoloxidase and ferroxidase activities and might be involved in the production of polyphenolic compounds and the prevention of oxidative damage in the periplasm', 'cueO');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735348', '511145.b0124', '511145', 'glucose dehydrogenase; GDH is probably involved in energy conservation rather than in sugar metabolism', 'gcd');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735349', '511145.b0125', '511145', 'hypoxanthine phosphoribosyltransferase; This enzyme acts exclusively on hypoxanthine; it does not act on guanine (By similarity)', 'hpt');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735350', '511145.b0126', '511145', 'carbonic anhydrase', 'can');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735351', '511145.b0127', '511145', 'predicted transporter subunit: ATP-binding component of ABC superfamily', 'yadG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735352', '511145.b0128', '511145', 'predicted transporter subunit: membrane component of ABC superfamily', 'yadH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735353', '511145.b0129', '511145', 'predicted PTS Enzyme IIA; The phosphoenolpyruvate-dependent sugar phosphotransferase system (sugar PTS), a major carbohydrate active -transport system, catalyzes the phosphorylation of incoming sugar substrates concomitantly with their translocation across the cell membrane (By similarity)', 'yadI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735354', '511145.b0130', '511145', 'predicted polysaccharide deacetylase lipoprotein', 'yadE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735355', '511145.b0131', '511145', 'aspartate 1-decarboxylase; Catalyzes the pyruvoyl-dependent decarboxylation of aspartate to produce beta-alanine', 'panD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735356', '511145.b0132', '511145', 'predicted transposase', 'yadD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735357', '511145.b0133', '511145', 'pantothenate synthetase; Catalyzes the condensation of pantoate with beta-alanine in an ATP-dependent reaction via a pantoyl-adenylate intermediate', 'panC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735358', '511145.b0134', '511145', '3-methyl-2-oxobutanoate hydroxymethyltransferase; Catalyzes the reversible reaction in which hydroxymethyl group from 5,10-methylenetetrahydrofolate is tranferred onto alpha-ketoisovalerate to form ketopantoate', 'panB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735359', '511145.b0135', '511145', 'predicted fimbrial-like adhesin protein', 'yadC');
