INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735363', '511145.b0139', '511145', 'predicted outer membrane usher protein; Probable porin-like protein necessary for the assembly of a pilin-type protein', 'htrE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735364', '511145.b0140', '511145', 'predicted periplasmic pilin chaperone; Probably mediates assembly of a pilin', 'ecpD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735365', '511145.b0141', '511145', 'predicted fimbrial-like adhesin protein', 'yadN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735366', '511145.b0142', '511145', '2-amino-4-hydroxy-6-hydroxymethyldihyropteridine pyrophosphokinase', 'folK');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735367', '511145.b0143', '511145', 'poly(A) polymerase I; Polymerase that creates the 3'' poly(A) tail found in some mRNA''s. Seems to be involved in plasmid copy number control', 'pcnB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735379', '511145.b0155', '511145', 'chloride channel, voltage-gated; Proton-coupled chloride transporter. Functions as antiport system and exchanges two chloride ions for 1 proton. Probably acts as an electrical shunt for an outwardly-directed proton pump that is linked to amino acid decarboxylation, as part of the extreme acid resistance (XAR) response', 'clcA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738492', '511145.b3564', '511145', 'xylulokinase', 'xylB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735368', '511145.b0144', '511145', 'glutamyl-Q tRNA(Asp) synthetase; Catalyzes the tRNA-independent activation of glutamate in presence of ATP and the subsequent transfer of glutamate onto tRNA(Asp). Glutamate is transferred on the 2-amino-5-(4,5- dihydroxy-2-cyclopenten-1-yl) moiety of the queuosine in position 34 of the tRNA(Asp), the wobble position of the QUC anticodon. Does not transfer glutamate to either tRNA(Glu) or tRNA(Gln). The incapacity of the glutamylated tRNA(Asp) to bind elongation factor Tu suggests that it is not involved in ribosomal protein biosynthesis', 'gluQ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735369', '511145.b0145', '511145', 'DNA-binding transcriptional regulator of rRNA transcription, DnaK suppressor protein; Dosage-dependent suppressor of a dnaK deletion mutation. It suppressed not only the temperature-sensitive growth but also the filamentous phenotype of the dnaK deletion strain, while the defect of lambda growth is not suppressed', 'dksA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735370', '511145.b0146', '511145', 'predicted DNA-binding transcriptional regulator; Probable regulatory factor involved in maltose metabolism', 'sfsA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735371', '511145.b0147', '511145', '2''-5'' RNA ligase; Specifically ligates tRNA half-molecules containing nucleoside base modifications and shows a preference among different tRNA species. Acts in the absence of ATP to form a 2''-5'' phosphodiester linkage', 'ligT');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735372', '511145.b0148', '511145', 'predicted ATP-dependent helicase', 'hrpB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735373', '511145.b0149', '511145', 'fused glycosyl transferase and transpeptidase; Cell wall formation. Synthesis of cross-linked peptidoglycan from the lipid intermediates. The enzyme has a penicillin-insensitive transglycosylase N-terminal domain (formation of linear glycan strands) and a penicillin-sensitive transpeptidase C-terminal domain (cross-linking of the peptide subunits)', 'mrcB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735374', '511145.b0150', '511145', 'ferrichrome outer membrane transporter; This receptor binds the ferrichrome-iron ligand. It interacts with the tonB protein, which is responsible for energy coupling of the ferrichrome-promoted iron transport system. Acts as a receptor for bacteriophage T5 as well as T1, phi80 and colicin M. Binding of T5 triggers the opening of a high conductance ion channel. Can also transport the antibiotic albomycin', 'fhuA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735375', '511145.b0151', '511145', 'iron-hydroxamate transporter subunit; Part of the ABC transporter complex fhuCDB involved in iron(3+)-hydroxamate import. Responsible for energy coupling to the transport system', 'fhuC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735376', '511145.b0152', '511145', 'iron-hydroxamate transporter subunit; Part of the ABC transporter complex fhuCDB involved in iron(3+)-hydroxamate import. Binds the iron(3+)-hydroxamate complex and transfers it to the membrane-bound permease. Required for the transport of all iron(3+)-hydroxamate siderophores such as ferrichrome, gallichrome, desferrioxamine, coprogen, aerobactin, shizokinen, rhodotorulic acid and the antibiotic albomycin', 'fhuD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735377', '511145.b0153', '511145', 'fused iron-hydroxamate transporter subunits of ABC superfamily: membrane components; Part of the ABC transporter complex fhuCDB involved in iron(3+)-hydroxamate import. Responsible for the translocation of the substrate across the membrane', 'fhuB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735378', '511145.b0154', '511145', 'glutamate-1-semialdehyde aminotransferase (aminomutase)', 'hemL');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735428', '511145.b0211', '511145', 'predicted membrane-bound lytic murein transglycosylase D; Murein-degrading enzyme. May play a role in recycling of muropeptides during cell elongation and/or cell division (By similarity)', 'mltD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735380', '511145.b0156', '511145', 'conserved protein; Probably involved in the insertion of Fe-S clusters into apoproteins in vivo including ispG and/or ispH. Essential for growth under aerobic conditions and for anaerobic respiration but not for fermentation. In vitro it binds Fe-S clusters and transfers them to apo-ispG, which is involved in quinone biosynthesis among many other cell components. Experiments indicate that it is probably also involved in the insertion of other Fe-S clusters than ispG/ispH', 'erpA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735381', '511145.b0157', '511145', 'conserved inner membrane protein', 'yadS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735382', '511145.b0158', '511145', 'vitamin B12 transporter subunit: periplasmic-binding component of ABC superfamily; Part of the ABC transporter complex btuCDF involved in vitamin B12 import. Binds vitamin B12 and delivers it to the periplasmic surface of btuC', 'btuF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735383', '511145.b0159', '511145', '5''-methylthioadenosine/S-adenosylhomocysteine nucleosidase; Catalyzes the irreversible cleavage of the glycosidic bond in both 5''-methylthioadenosine (MTA) and S- adenosylhomocysteine (SAH/AdoHcy) to adenine and the corresponding thioribose, 5''-methylthioribose and S-ribosylhomocysteine, respectively. Can also use 5''-isobutylthioadenosine, 5''-n- butylthioadenosine, S-adenosyl-D-homocysteine, decarboxylated adenosylhomocysteine, deaminated adenosylhomocysteine and S-2-aza- adenosylhomocysteine as substrates', 'mtnN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735384', '511145.b0160', '511145', 'deoxyguanosine triphosphate triphosphohydrolase; dGTPase preferentially hydrolyzes dGTP over the other canonical NTPs', 'dgt');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735385', '511145.b0161', '511145', 'serine endoprotease (protease Do), membrane-associated; Serine protease that is required at high temperature. Involved in the degradation of damaged proteins. It can degrade iciA, ada, casein and globin. Shared specificity with degQ', 'degP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735386', '511145.b0162', '511145', 'DNA-binding transcriptional activator; Seems to regulate the expression of the operons for the enzymes involved in D-galactarate, D-glucarate and D-glycerate utilization', 'cdaR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735387', '511145.b0163', '511145', 'conserved protein', 'yaeH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735388', '511145.b0164', '511145', 'predicted phosphatase; Shows phosphodiesterase activity, hydrolyzing phosphodiester bond in the artificial chromogenic substrate bis-p- nitrophenyl phosphate (bis-pNPP)', 'yaeI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735389', '511145.b0166', '511145', '2,3,4,5-tetrahydropyridine-2-carboxylate N-succinyltransferase', 'dapD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735390', '511145.b0167', '511145', 'uridylyltransferase; Modifies, by uridylylation or deuridylylation the PII (glnB) regulatory protein', 'glnD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735391', '511145.b0168', '511145', 'methionine aminopeptidase; Removes the amino-terminal methionine from nascent proteins (By similarity)', 'map');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735392', '511145.b0169', '511145', '30S ribosomal subunit protein S2', 'rpsB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735393', '511145.b0170', '511145', 'protein chain elongation factor EF-Ts; Associates with the EF-Tu.GDP complex and induces the exchange of GDP to GTP. It remains bound to the aminoacyl-tRNA.EF- Tu.GTP complex up to the GTP hydrolysis stage on the ribosome (By similarity)', 'tsf');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735394', '511145.b0171', '511145', 'uridylate kinase; Catalyzes the reversible phosphorylation of UMP to UDP, with ATP as the most efficient phosphate donor', 'pyrH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735395', '511145.b0172', '511145', 'ribosome recycling factor; Responsible for the release of ribosomes from messenger RNA at the termination of protein biosynthesis. May increase the efficiency of translation by recycling ribosomes from one round of translation to another', 'frr');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735430', '511145.b0213', '511145', 'predicted S-adenosyl-L-methionine-dependent methyltransferase', 'yafS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735396', '511145.b0173', '511145', '1-deoxy-D-xylulose 5-phosphate reductoisomerase; Catalyzes the NADP-dependent rearrangement and reduction of 1-deoxy-D-xylulose-5-phosphate (DXP) to 2-C-methyl-D-erythritol 4-phosphate (MEP) (By similarity)', 'dxr');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735397', '511145.b0174', '511145', 'undecaprenyl pyrophosphate synthase; Generates undecaprenyl pyrophosphate (UPP) from isopentenyl pyrophosphate (IPP). UPP is the precursor of glycosyl carrier lipid in the biosynthesis of bacterial cell wall polysaccharide components such as peptidoglycan and lipopolysaccharide', 'uppS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735398', '511145.b0175', '511145', 'CDP-diglyceride synthase', 'cdsA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735399', '511145.b0176', '511145', 'zinc metallopeptidase; Cleaves the peptide bond between ''Ala-108'' and ''Cys-109'' in the transmembrane region of rseA. Acts on degS-cleaved rseA to release the cytoplasmic domain of rseA. This provides the cell with sigma E (rpoE) activity through the proteolysis of rseA. In vitro, can also cleave sequences in transmembrane regions of other proteins as well as the signal sequence of beta-lactamase. Purified rseP was also shown to degrade rpoH and rpoE in vitro', 'rseP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735400', '511145.b0177', '511145', 'conserved protein; Involved in the assembly of outer membrane proteins. Does not play a direct role in the export of outer membrane lipids', 'yaeT');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735401', '511145.b0178', '511145', 'periplasmic chaperone; Molecular chaperone that interacts specifically with outer membrane proteins, thus maintaining the solubility of early folding intermediates during passage through the periplasm. Required for the efficient release of ompA from the inner membrane, the maintenance of its solubility in the periplasm, and, in association with lipopolysaccharide (LPS), for the efficient folding and insertion of ompA into the outer membrane', 'skp');
