INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735588', '511145.b0397', '511145', 'exonuclease, dsDNA, ATP-dependent; SbcCD cleaves DNA hairpin structures. These structures can inhibit DNA replication and are intermediates in certain DNA recombination reactions. The complex acts as a 3''->5'' double strand exonuclease that can open hairpins. It also has a 5'' single-strand endonuclease activity', 'sbcC');
