INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735597', '511145.b0406', '511145', 'tRNA-guanine transglycosylase; Exchanges the guanine residue with 7-aminomethyl-7- deazaguanine in tRNAs with GU(N) anticodons (tRNA-Asp, -Asn, -His and -Tyr). After this exchange, a cyclopentendiol moiety is attached to the 7-aminomethyl group of 7-deazaguanine, resulting in the hypermodified nucleoside queuosine (Q) (7-(((4,5-cis- dihydroxy-2-cyclopenten-1-yl)amino)methyl)-7-deazaguanosine) (By similarity)', 'tgt');
