INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735707', '511145.b0523', '511145', 'N5-carboxyaminoimidazole ribonucleotide mutase; This subunit can alone transform AIR to CAIR, but in association with purK, which possesses an ATPase activity, an enzyme complex is produced which is capable of converting AIR to CAIR efficiently under physiological condition', 'purE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735708', '511145.b0524', '511145', 'UDP-2,3-diacylglucosamine pyrophosphatase; Catalyzes the hydrolysis of the pyrophosphate bond of UDP-2,3-diacylglucosamine to yield 2,3-diacylglucosamine 1- phosphate (lipid X) and UMP (By similarity)', 'lpxH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735709', '511145.b0525', '511145', 'peptidyl-prolyl cis-trans isomerase B (rotamase B); PPIases accelerate the folding of proteins. It catalyzes the cis-trans isomerization of proline imidic peptide bonds in oligopeptides (By similarity)', 'ppiB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735710', '511145.b0526', '511145', 'cysteinyl-tRNA synthetase', 'cysS');
