INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735712', '511145.b0528', '511145', 'predicted RNA-binding protein; Its structure and the presence of conserved basic residues indicates that it probably binds RNA', 'ybcJ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735713', '511145.b0529', '511145', 'bifunctional 5,10-methylene-tetrahydrofolate dehydrogenase/ 5,10-methylene-tetrahydrofolate cyclohydrolase; Catalyzes the oxidation of 5,10- methylenetetrahydrofolate to 5,10-methenyltetrahydrofolate and then the hydrolysis of 5,10-methenyltetrahydrofolate to 10- formyltetrahydrofolate. This enzyme is specific for NADP', 'folD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735714', '511145.b0530', '511145', 'predicted fimbrial-like adhesin protein; Fimbriae (also called pili), polar filaments radiating from the surface of the bacterium to a length of 0.5-1.5 micrometers and numbering 100-300 per cell, enable bacteria to colonize the epithelium of specific host organs (By similarity)', 'sfmA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735715', '511145.b0531', '511145', 'pilin chaperone, periplasmic; Required for the biogenesis of sfmA fimbriae. Binds and interact with sfmH (By similarity)', 'sfmC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735716', '511145.b0532', '511145', 'predicted outer membrane export usher protein; Involved in the export and assembly of sfmA fimbrial subunits across the outer membrane (By similarity)', 'sfmD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735717', '511145.b0533', '511145', 'predicted fimbrial-like adhesin protein; Involved in regulation of length and mediation of adhesion of sfmA fimbriae (but not necessary for the production of fimbriae). Seems to be mannose binding adhesin (By similarity)', 'sfmH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735718', '511145.b0534', '511145', 'predicted fimbrial-like adhesin protein', 'sfmF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735719', '511145.b0535', '511145', 'predicted DNA-binding transcriptional regulator', 'fimZ');
