INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735720', '511145.b0537', '511145', 'DLP12 prophage; predicted integrase; Integrase from the cryptic lambdoic prophage DLP12. Integrase is necessary for integration of the phage into the host genome by site-specific recombination. In conjunction with excisionase, integrase is also necessary for excision of the prophage from the host genome', 'intD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735721', '511145.b0540', '511145', 'IS3 element protein InsE', 'b0540');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735722', '511145.b0541', '511145', 'IS3 element protein InsF', 'b0541');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735723', '511145.b0543', '511145', 'DLP12 prophage; multidrug resistance protein; Multidrug transporter that expels positively charged hydrophobic drugs across the inner membrane of E.coli., thereby conferring resistance to a wide range of toxic compounds. The drug efflux is coupled to an influx of protons. Is involved in the resistance of E.coli cells to methyl viologen, ethidium bromide and acriflavine. Is also able to transport tetraphenylphosphonium (TPP(+)) and benzalkonium', 'emrE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735724', '511145.b0544', '511145', 'DLP12 prophage; predicted recombinase', 'ybcK');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735725', '511145.b0545', '511145', 'DLP12 prophage; predicted kinase inhibitor', 'ybcL');
