INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735728', '511145.b0548', '511145', 'DLP12 prophage; conserved protein', 'ninE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735729', '511145.b0549', '511145', 'DLP12 prophage; predicted protein', 'ybcO');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735730', '511145.b0550', '511145', 'DLP12 prophage; endonuclease RUS; Endonuclease that resolves Holliday junction intermediates made during homologous genetic recombination and DNA repair. Exhibits sequence and structure-selective cleavage of four-way DNA junctions, where it introduces symmetrical nicks in two strands of the same polarity at the 5'' side of CC dinucleotides. Corrects the defects in genetic recombination and DNA repair associated with inactivation of ruvAB or ruvC', 'rusA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735731', '511145.b0551', '511145', 'DLP12 prophage; predicted antitermination protein; Positively regulate expression of some phage genes. Bacterial host RNA polymerase modified by antitermination proteins transcribes through termination sites that otherwise prevent expression of the regulated genes (By similarity)', 'quuD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735732', '511145.b0552', '511145', 'IS5 transposase and trans-activator', 'b0552');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735733', '511145.b0554', '511145', 'DLP12 prophage; predicted phage lysis protein', 'essD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735734', '511145.b0555', '511145', 'DLP12 prophage; predicted lysozyme; Essential for lysis of bacterial cell wall, by showing cell wall hydrolyzing activity (By similarity)', 'arrD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735735', '511145.b0556', '511145', 'DLP12 prophage; predicted murein endopeptidase; Necessary for host cell lysis. It is believed to code for an endopeptidase that cleaves the amino-carboxyl cross-link between the diaminopimelic acid and D-alanine residues in the murein component of the bacterial cell wall (By similarity)', 'rzpD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735736', '511145.b0557', '511145', 'DLP12 prophage; predicted lipoprotein', 'iss');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735737', '511145.b0558', '511145', 'DLP12 prophage; predicted protein', 'ybcV');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735738', '511145.b0559', '511145', 'DLP12 prophage; predicted protein', 'ybcW');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735739', '511145.b0560', '511145', 'DLP12 prophage; DNA packaging protein', 'nohA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735768', '511145.b0592', '511145', 'iron-enterobactin transporter subunit; Binds ferrienterobactin; part of the binding-protein- dependent transport system for uptake of ferrienterobactin', 'fepB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735769', '511145.b0593', '511145', 'isochorismate synthase 1', 'entC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736139', '511145.b0992', '511145', 'predicted 4Fe-4S membrane protein', 'yccM');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735740', '511145.b0564', '511145', 'DNA-binding transcriptional activator; DLP12 prophage; Induces the synthesis of acid phosphatase (appA) and several other polypeptides (such as appBC) during the deceleration phase of growth. It also acts as a transcriptional repressor for one group of proteins that are synthesized preferentially in exponential growth and for one group synthesized only in the stationary phase. Also involved in the stabilization of the sigma stress factor rpoS during stress conditions', 'appY');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735741', '511145.b0565', '511145', 'DLP12 prophage; outer membrane protease VII (outer membrane protein 3b); Protease that can cleave T7 RNA polymerase, ferric enterobactin receptor protein (FEP), antimicrobial peptide protamine and other proteins. This protease has a specificity for paired basic residues', 'ompT');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735742', '511145.b0566', '511145', 'DNA-binding transcriptional activator of porin biosynthesis; Influences the temperature-dependent expression of several E.coli envelope proteins, most notably the porins ompF and ompC and the lambda receptor, lamB', 'envY');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735743', '511145.b0567', '511145', 'predicted protein', 'ybcH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735744', '511145.b0568', '511145', 'bacteriophage N4 receptor, outer membrane subunit; Required for bacteriophage N4 adsorption. Serves as the phage receptor', 'nfrA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735745', '511145.b0569', '511145', 'bacteriophage N4 receptor, inner membrane subunit; Required for bacteriophage N4 adsorption. May be a component of the phage receptor', 'nfrB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735746', '511145.b0570', '511145', 'sensory histidine kinase in two-component regulatory system with CusR, senses copper ions; Member of the two-component regulatory system cusS/cusR. Copper ion sensor. Could also be a silver ion sensor. Probably activates cusR by phosphorylation', 'cusS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735747', '511145.b0571', '511145', 'DNA-binding response regulator in two-component regulatory system with CusS; Member of the two-component regulatory system cusS/cusR. Activates the expression of cusCFBA and plasmid pRJ1004 gene pcoE in response to increasing levels of copper ions, and probably silver ions. Can also increase the basal-level expression of copper resistance gene operon pcoABCD', 'cusR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735748', '511145.b0572', '511145', 'copper/silver efflux system, outer membrane component; Part of a cation efflux system that mediates resistance to copper and silver. In pathogenic strains it allows the bacteria to invade brain microvascular endothelial cells (BMEC) thus allowing it to cross the blood-brain barrier and cause neonatal meningitis', 'cusC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735749', '511145.b0573', '511145', 'periplasmic copper-binding protein; Part of a cation efflux system that mediates resistance to copper and silver. Binds one copper per polypeptide', 'cusF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735750', '511145.b0574', '511145', 'copper/silver efflux system, membrane fusion protein; Part of a cation efflux system that mediates resistance to copper and silver', 'cusB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735751', '511145.b0575', '511145', 'copper/silver efflux system, membrane component; Part of a cation efflux system that mediates resistance to copper and silver', 'cusA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735752', '511145.b0576', '511145', 'phenylalanine transporter; Permease that is involved in the transport across the cytoplasmic membrane of phenylalanine', 'pheP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735753', '511145.b0577', '511145', 'predicted mechanosensitive channel', 'ybdG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735789', '511145.b0614', '511145', 'apo-citrate lyase phosphoribosyl-dephospho-CoA transferase; Transfers 2-(5''''-triphosphoribosyl)-3''- dephosphocoenzyme-A on a serine residue to the apo-acyl carrier protein (gamma chain) of the citrate lyase to yield holo-acyl carrier protein', 'citX');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735754', '511145.b0578', '511145', 'dihydropteridine reductase, NAD(P)H-dependent, oxygen-insensitive; Reduction of a variety of nitroaromatic compounds using NADH (and to lesser extent NADPH) as source of reducing equivalents; two electrons are transferred. Capable of reducing nitrofurazone, quinones and the anti-tumor agent CB1954 (5- (aziridin-1-yl)-2,4-dinitrobenzamide). The reduction of CB1954 results in the generation of cytotoxic species', 'nfnB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735755', '511145.b0579', '511145', 'conserved protein', 'ybdF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735756', '511145.b0580', '511145', 'predicted inner membrane protein', 'ybdJ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735757', '511145.b0581', '511145', 'gamma-glutamyl:cysteine ligase; ATP-dependent carboxylate-amine ligase which exhibits weak glutamate--cysteine ligase activity. However, because of the low catalytic rate, the question remains whether L-cysteine is the actual biological substrate', 'ybdK');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735758', '511145.b0582', '511145', 'IS186/IS421 transposase', 'b0582');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735759', '511145.b0583', '511145', 'phosphopantetheinyltransferase component of enterobactin synthase multienzyme complex; Catalyzes the transfer of the 4''-phosphopantetheine moiety from coenzyme A to apo-domains of both entB (an ArCP domain) and entF (a PCP domain). Plays an essential role in the assembly of the enterobactin', 'entD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735760', '511145.b0584', '511145', 'iron-enterobactin outer membrane transporter; This protein is involved in the initial step of iron uptake by binding ferrienterobactin (Fe-ENT), an iron chelatin siderophore that allows E.coli to extract iron from the environment. FepA also acts as a receptor for colicins B and D', 'fepA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735761', '511145.b0585', '511145', 'enterobactin/ferric enterobactin esterase; Upon internalization, ferric enterobactin is processed via an exquisitely specific pathway that is dependent on FES activity, making iron available for metabolic use', 'fes');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735762', '511145.b0586', '511145', 'enterobactin synthase multienzyme complex component,  ATP-dependent; Activates the carboxylate group of L-serine via ATP- dependent PPi exchange reactions to the aminoacyladenylate, preparing that molecule for the final stages of enterobactin synthesis. Holo-entF acts as the catalyst for the formation of the three amide and three ester bonds present in the cyclic (2,3- dihydroxybenzoyl)serine trimer enterobactin, using seryladenylate and acyl-holo-entB (acylated with 2,3-dihydroxybenzoate by entE)', 'entF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735763', '511145.b0587', '511145', 'regulator of length of O-antigen component of lipopolysaccharide chains; Part of the ferric enterobactin transport system', 'fepE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735764', '511145.b0588', '511145', 'iron-enterobactin transporter subunit; Part of the binding-protein-dependent transport system for ferric enterobactin. Probably responsible for energy coupling to the transport system', 'fepC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735765', '511145.b0589', '511145', 'iron-enterobactin transporter subunit; Part of the binding-protein-dependent transport system for ferric enterobactin. Probably responsible for the translocation of the substrate across the membrane', 'fepG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735766', '511145.b0590', '511145', 'iron-enterobactin transporter subunit; Part of the binding-protein-dependent transport system for ferric enterobactin. Probably responsible for the translocation of the substrate across the membrane', 'fepD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735767', '511145.b0591', '511145', 'predicted transporter; Exports the siderophore enterobactin out of the cell', 'entS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735770', '511145.b0594', '511145', '2,3-dihydroxybenzoate-AMP ligase component of enterobactin synthase multienzyme complex; Activates the carboxylate group of 2,3-dihydroxy- benzoate (2,3-DHB), via ATP-dependent PPi exchange reactions, to the acyladenylate. Then, catalyzes the acylation of holo-entB with 2,3-DHB adenylate, preparing that molecule for amide bond formation with L-serine', 'entE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735771', '511145.b0595', '511145', 'isochorismatase; Required for production of 2,3-DHB. Also serves as an aryl carrier protein and plays a role in enterobactin assembly', 'entB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735772', '511145.b0596', '511145', '2,3-dihydro-2,3-dihydroxybenzoate dehydrogenase', 'entA');
