INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735777', '511145.b0601', '511145', 'conserved protein', 'ybdM');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735778', '511145.b0602', '511145', 'conserved protein', 'ybdN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735779', '511145.b0603', '511145', 'predicted DNA-binding transcriptional regulator', 'ybdO');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735780', '511145.b0604', '511145', 'periplasmic disulfide isomerase/thiol-disulphide oxidase; Involved in disulfide bond formation. Functions probably as a disulfide isomerase with a narrower substrate specificity than dsbC. DsbG is maintained in a reduced state by dsbD. In vitro, displays chaperone activity in both redox states', 'dsbG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735781', '511145.b0605', '511145', 'alkyl hydroperoxide reductase, C22 subunit; Directly reduces organic hydroperoxides in its reduced dithiol form', 'ahpC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735782', '511145.b0606', '511145', 'alkyl hydroperoxide reductase, F52a subunit, FAD/NAD(P)-binding; Serves to protect the cell against DNA damage by alkyl hydroperoxides. It can use either NADH or NADPH as electron donor for direct reduction of redox dyes or of alkyl hydroperoxides when combined with the ahpC protein', 'ahpF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735783', '511145.b0607', '511145', 'universal stress protein UP12', 'uspG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735784', '511145.b0608', '511145', 'predicted oxidoreductase, Zn-dependent and NAD(P)-binding', 'ybdR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735785', '511145.b0610', '511145', 'regulator of nucleoside diphosphate kinase; Rnk and sspA can functionally replace P.aeruginosa alginate regulatory gene algR2', 'rnk');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735786', '511145.b0611', '511145', 'ribonuclease I; One of the few RNases that cleaves the phosphodiester bond between any two nucleotide. Shows a preference for cytidylic or guanylic acid', 'rna');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735787', '511145.b0612', '511145', 'citrate:succinate antiporter; Responsible for the uptake of citrate in exchange to the efflux of succinate. Has a relatively broad specificity for C(4)- dicarboxylates and tricarboxylates', 'citT');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735788', '511145.b0613', '511145', 'triphosphoribosyl-dephospho-CoA transferase; Catalyzes the formation of 2-(5''''-triphosphoribosyl)-3''- dephosphocoenzyme-A, the precursor of the prosthetic group of the holo-acyl carrier protein (gamma chain) of citrate lyase, from ATP and dephospho-CoA', 'citG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735790', '511145.b0615', '511145', 'citrate lyase, citrate-ACP transferase (alpha) subunit; Represents a citrate:acetyl-ACP transferase (By similarity)', 'citF');
