INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735794', '511145.b0619', '511145', 'sensory histidine kinase in two-component regulatory system with CitB; Member of the two-component regulatory system dpiA/dpiB essential for expression of citrate-specific fermentation genes and genes involved in plasmid inheritance. May activate dpiA by phosphorylation', 'dpiB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4735795', '511145.b0620', '511145', 'DNA-binding response regulator in two-component regulatory system with CitA; Member of the two-component regulatory system dpiA/dpiB essential for expression of citrate-specific fermentation genes and genes involved in plasmid inheritance', 'dpiA');
