INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736028', '511145.b0879', '511145', 'fused macrolide transporter subunits of ABC superfamily: ATP-binding component/membrane component; Part of the ABC transporter complex macAB involved in macrolide export. Transmembrane domains (TMD) form a pore in the inner membrane and the ATP-binding domain (NBD) is responsible for energy generation. Seems to confer resistance against macrolides composed of 14- and 15-membered lactones but no or weak resistance against 16-membered ones (Probable)', 'macB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736029', '511145.b0880', '511145', 'cold shock protein homolog; Inhibits DNA replication at both initiation and elongation steps, most probably by binding to the opened, single- stranded regions at replication forks. Plays a regulatory role in chromosomal replication in nutrient-depleted cells', 'cspD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736030', '511145.b0881', '511145', 'regulatory protein for ClpA substrate specificity; Involved in the modulation of the specificity of the clpAP-mediated ATP-dependent protein degradation (By similarity)', 'clpS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736031', '511145.b0882', '511145', 'ATPase and specificity subunit of ClpA-ClpP ATP-dependent serine protease, chaperone activity; ATP-dependent specificity component of the clpP protease. It directs the protease to specific substrates. The primary function of the clpA-clpP complex appears to be the degradation of unfolded or abnormal proteins', 'clpA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736032', '511145.b0884', '511145', 'translation initiation factor IF-1; No specific function has so far been attributed to this initiation factor; however, it seems to stimulate more or less all the activities of the other two initiation factors, IF-2 and IF-3', 'infA');
