INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736037', '511145.b0889', '511145', 'DNA-binding transcriptional dual regulator, leucine-binding; Mediates a global response to leucine. Exogenous leucine affects the expression of a number of different operons; lrp mediates this effect for at least some of these operons. For example it is regulator of the branched-chain amino acid transport genes', 'lrp');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736038', '511145.b0890', '511145', 'DNA translocase at septal ring sorting daughter chromsomes; DNA motor protein, which is both required to move DNA out of the region of the septum during cell division and for the septum formation. Tracks DNA in an ATP-dependent manner by generating positive supercoils in front of it and negative supercoils behind it. Also plays a role in resolution of dimer chromosomes by regulating the xerC and xerD recombination complex, possibly by switching the catalytic state of the two recombinases. Required for the targeting of ftsQ, ftsL and ftsI to the septum', 'ftsK');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736039', '511145.b0891', '511145', 'chaperone for lipoproteins; Participates in the translocation of lipoproteins from the inner membrane to the outer membrane. Only forms a complex with a lipoprotein if the residue after the N-terminal Cys is not an aspartate (The Asp acts as a targeting signal to indicate that the lipoprotein should stay in the inner membrane); the inner membrane retention signal functions at the release step', 'lolA');
