INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736042', '511145.b0894', '511145', 'dimethyl sulfoxide reductase, anaerobic, subunit A; Terminal reductase during anaerobic growth on various sulfoxide and N-oxide compounds. Allows E.coli to grow anaerobically on Me(2)SO as respiratory oxidant', 'dmsA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736043', '511145.b0895', '511145', 'dimethyl sulfoxide reductase, anaerobic, subunit B; Electron transfer subunit of the terminal reductase during anaerobic growth on various sulfoxide and N-oxide compounds', 'dmsB');
