INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736070', '511145.b0922', '511145', 'Involved in chromosome partioning, Ca2+ binding protein; Involved in chromosome condensation, segregation and cell cycle progression. May participate in facilitating chromosome segregation by condensation DNA from both sides of a centrally located replisome during cell division. Not required for mini-F plasmid partitioning. Probably acts via its interaction with mukB and mukE. Overexpression results in anucleate cells. It has a calcium binding activity', 'mukF');
