INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736140', '511145.b0993', '511145', 'hybrid sensory histidine kinase in two-component regulatory system with TorR; Member of the two-component regulatory system torS/torR involved in the anaerobic utilization of trimethylamine-N-oxide (TMAO). Detects the presence of TMAO in the medium and, in response, activates torR via a four-step phosphorelay. When TMAO is removed, torS can dephosphorylate torR, probably by a reverse phosphorelay involving His-860 and Asp-733', 'torS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736141', '511145.b0994', '511145', 'periplasmic sensory protein associated with the TorRS two-component regulatory system; Upon binding a putative inducer it probably interacts with torS and allows it to play a role in the induction of the torCAD operon for trimethylamine N-oxide reductase', 'torT');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736142', '511145.b0995', '511145', 'DNA-binding response regulator in two-component regulatory system with TorS; Member of the two-component regulatory system torS/torR involved in the anaerobic utilization of trimethylamine-N-oxide (TMAO). Phosphorylated torR activates the transcription of the torCAD operon by binding to four decameric boxes located in the torCAD promoter. Box1, 2 and 4 contain the DNA sequence 5''- CTGTTCATAT-3'' and box3 contains the DNA sequence 5''-CCGTTCATCC-3''. Phosphorylated as well as unphosphorylated torR negatively regulates its own expression by binding to box1 and 2', 'torR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736143', '511145.b0996', '511145', 'trimethylamine N-oxide (TMAO) reductase I, cytochrome c-type subunit; Part of the anaerobic respiratory chain of trimethylamine-N-oxide reductase torA. Acts by transferring electrons from the membranous menaquinones to torA. This transfer probably involves an electron transfer pathway from menaquinones to the N-terminal domain of torC, then from the N-terminus to the C-terminus, and finally to torA. TorC apocytochrome negatively autoregulates the torCAD operon probably by inhibiting the torS kinase activity', 'torC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736144', '511145.b0997', '511145', 'trimethylamine N-oxide (TMAO) reductase I, catalytic subunit; Reduces trimethylamine-N-oxide (TMAO) into trimethylamine; an anaerobic reaction coupled to energy-yielding reactions', 'torA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736145', '511145.b0998', '511145', 'chaperone involved in maturation of TorA subunit of trimethylamine N-oxide reductase system I; Involved in the biogenesis of torA. Acts on torA before the insertion of the molybdenum cofactor and, as a result, probably favors a conformation of the apoenzyme that is competent for acquiring the cofactor', 'torD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736146', '511145.b0999', '511145', 'modulator of CbpA co-chaperone; Interacts with cbpA and inhibits both the dnaJ-like co- chaperone activity and the DNA binding activity of cbpA. Together with cbpA, modulates the activity of the dnaK chaperone system. Does not inhibit the co-chaperone activity of dnaJ', 'cbpM');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736147', '511145.b1000', '511145', 'curved DNA-binding protein, DnaJ homologue that functions as a co-chaperone of DnaK; DNA-binding protein that preferentially recognizes a curved DNA sequence. It is probably a functional analog of dnaJ; displays overlapping activities with dnaJ, but functions under different conditions, probably acting as a molecular chaperone in an adaptive response to environmental stresses other than heat shock. Lacks autonomous chaperone activity; binds native substrates and targets them for recognition by dnaK. Its activity is inhibited by the binding of cbpM', 'cbpA');
