INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736151', '511145.b1004', '511145', 'NAD(P)H:quinone oxidoreductase; Seems to enhance the formation and/or stability of noncovalent complexes between the trp repressor protein and operator-bearing DNA. However, wrbA does not specifically influence the affinity or mode of binding of trpR to its operator. It seems possible that the association may have a structural, rather than functional, basis. WrbA alone does not interact with the operator-bearing DNA; the trpR/trpO complex is probably the major target species. The wrbA protein may function as an accessory element in blocking trpR-specific transcriptional processes that  [...] ', 'wrbA');
