INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736230', '511145.b1091', '511145', '3-oxoacyl-[acyl-carrier-protein] synthase III; Catalyzes the condensation reaction of fatty acid synthesis by the addition to an acyl acceptor of two carbons from malonyl-ACP. Catalyzes the first condensation reaction which initiates fatty acid synthesis and may therefore play a role in governing the total rate of fatty acid production. Possesses both acetoacetyl-ACP synthase and acetyl transacylase activities. Has some substrate specificity for acetyl-CoA. Its substrate specificity determines the biosynthesis of straight-chain of fatty acids instead of branched-chain', 'fabH');
