INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736268', '511145.b1129', '511145', 'sensory histidine kinase in two-component regulatory system with PhoP; Member of the two-component regulatory system phoQ/phoP involved in adaptation to low Mg(2+) environments and the control of acid resistance genes. In presence of low periplasmic Mg(2+) concentrations, phoQ functions as a membrane-associated protein kinase that undergoes autophosphorylation and subsequently transfers the phosphate to phoP, which results in the expression of phoP-activated genes (PAG) and repression of phoP-repressed genes (PRG). In presence of high periplasmic Mg(2+) concentrations, acts as a protei [...] ', 'phoQ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736269', '511145.b1130', '511145', 'DNA-binding response regulator in two-component regulatory system with PhoQ; Member of the two-component regulatory system phoQ/phoP involved in adaptation to low Mg(2+) environments and the control of acid resistance genes. Mediates magnesium influx to the cytosol by activation of mgtA. Promotes expression of the two-component regulatory system rstA/rstB and transcription of the hemL, mgrB, nagA, slyB, vboR and yrbL genes', 'phoP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736271', '511145.b1132', '511145', 'predicted lysogenization regulator; Negative regulator of phage lambda lysogenization. Contributes to the degradation of the phage regulatory protein CII. Acts probably by holding CII on the membrane surface, away from the target promoters, but close to the ftsH protease', 'hflD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736272', '511145.b1133', '511145', 'tRNA (5-methylaminomethyl-2-thiouridylate)-methyltransferase; Catalyzes the 2-thiolation of uridine at the wobble position (U34) of tRNA(Lys), tRNA(Glu) and tRNA(Gln), leading to the formation of s(2)U34, the first step of tRNA-mnm(5)s(2)U34 synthesis. Sulfur is provided by iscS, via a sulfur-relay system. Binds ATP and its substrate tRNAs', 'mnmA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736273', '511145.b1134', '511145', 'bifunctional thiamin pyrimidine pyrophosphate hydrolase/thiamin pyrophosphate hydrolase; Catalyzes the hydrolysis of 4-amino-2-methyl-5- hydroxymethylpyrimidine pyrophosphate (HMP-PP) to 4-amino-2- methyl-5-hydroxymethylpyrimidine phosphate (HMP-P), and hydrolysis of thiamine pyrophosphate (TPP) to thiamine monophosphate (TMP). Can hydrolyze other substrates such as MeO-HMP-PP, CF(3)-HMP-PP and MeO-TPP. Is also a non-specific nucleoside tri- and diphosphatase that releases inorganic orthophosphate', 'nudJ');
