INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736306', '511145.b1175', '511145', 'membrane ATPase of the MinC-MinD-MinE system; ATPase required for the correct placement of the division site. Cell division inhibitors minC and minD act in concert to form an inhibitor capable of blocking formation of the polar Z ring septums. Rapidly oscillates between the poles of the cell to destabilize ftsZ filaments that have formed before they mature into polar Z rings', 'minD');
