INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736317', '511145.b1186', '511145', 'sodium:proton antiporter; Na(+)/H(+) antiporter that extrudes sodium in exchange for external protons. Catalyzes the exchange of 3 H(+) per 2 Na(+). Has a high affinity for sodium, but can also transport lithium. Activity is weakly pH-dependent. Essential for regulation of intracellular pH under alkaline conditions', 'nhaB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736318', '511145.b1187', '511145', 'DNA-binding transcriptional dual regulator of fatty acid metabolism; Multifunctional regulator of fatty acid metabolism. Represses transcription of at least eight genes required for fatty acid transport and beta-oxidation including fadA, fadB, fadD, fadL and fadE. Activates transcription of at least three genes required for unsaturated fatty acid biosynthesis: fabA, fabB and iclR, the gene encoding the transcriptional regulator of the aceBAK operon encoding the glyoxylate shunt enzymes. Binding of fadR is specifically inhibited by long chain fatty acyl-CoA compounds', 'fadR');
