INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736323', '511145.b1192', '511145', 'L,D-carboxypeptidase A; Releases the terminal D-alanine residue from the cytoplasmic tetrapeptide recycling product L-Ala-gamma-D-Glu-meso- Dap-D-Ala. To a lesser extent, can also cleave D-Ala from murein derivatives containing the tetrapeptide, i.e. MurNAc-tetrapeptide, UDP-MurNAc-tetrapeptide, GlcNAc-MurNAc-tetrapeptide, and GlcNAc- anhMurNAc-tetrapeptide. Does not act on murein sacculi or cross- linked muropeptides. The tripeptides produced by the lcdA reaction can then be reused as peptidoglycan building blocks; lcdA is thereby involved in murein recycling. Is also essential for vi [...] ', 'ldcA');
