INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736329', '511145.b1198', '511145', 'fused predicted dihydroxyacetone-specific PTS enzymes: HPr component/EI component; Phosphotransferase subunit of the dihydroxyacetone kinase, which is responsible for phosphorylating dihydroxyacetone. DhaM serves as the phosphoryl donor. It is phosphorylated by HPr, then it donates its phosphoryl group to dhaL-ADP, which eventually transmits it to dihydroxyacetone', 'dhaM');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736330', '511145.b1199', '511145', 'dihydroxyacetone kinase, C-terminal domain; ADP-binding subunit of the dihydroxyacetone kinase, which is responsible for phosphorylating dihydroxyacetone. DhaL- ADP receives a phosphoryl group from dhaM and transmits it to dihydroxyacetone. DhaL-ADP acts also as a coactivator by binding to the sensor domain of dhaR. DhaL-ATP is inactive', 'dhaL');
