INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736352', '511145.b1221', '511145', 'DNA-binding response regulator in two-component regulatory system with NarX (or NarQ); This protein activates the expression of the nitrate reductase (narGHJI) and formate dehydrogenase-N (fdnGHI) operons and represses the transcription of the fumarate reductase (frdABCD) operon in response to a nitrate/nitrite induction signal transmitted by either the narX or narQ proteins', 'narL');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736353', '511145.b1222', '511145', 'sensory histidine kinase in two-component regulatory system with NarL; Acts as a sensor for nitrate/nitrite and transduces signal of nitrate availability to the narL protein and of both nitrate/nitrite to the narP protein. NarX probably activates narL and narP by phosphorylation in the presence of nitrate. NarX also plays a negative role in controlling narL activity, probably through dephosphorylation in the absence of nitrate', 'narX');
