INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736356', '511145.b1225', '511145', 'nitrate reductase 1, beta (Fe-S) subunit; The nitrate reductase enzyme complex allows E.coli to use nitrate as an electron acceptor during anaerobic growth. The beta chain is an electron transfer unit containing four cysteine clusters involved in the formation of iron-sulfur centers. Electrons are transferred from the gamma chain to the molybdenum cofactor of the alpha subunit', 'narH');
