INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736358', '511145.b1227', '511145', 'nitrate reductase 1, gamma (cytochrome b(NR)) subunit; The nitrate reductase enzyme complex allows E.coli to use nitrate as an electron acceptor during anaerobic growth. The gamma chain is a membrane-embedded heme-iron unit resembling cytochrome b, which transfers electrons from quinones to the beta subunit', 'narI');
