INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736365', '511145.b1237', '511145', 'global DNA-binding transcriptional dual regulator H-NS; H-NS binds tightly to ds-DNA, increases its thermal stability and inhibits transcription. It also binds to ss-DNA and RNA but with a much lower affinity. H-NS has possible histone-like function. May be a global transcriptional regulator through its ability to bind to curved DNA sequences, which are found in regions upstream of a certain subset of promoters. It plays a role in the thermal control of pili production. It is subject to transcriptional auto-repression. It binds preferentially to the upstream region of its own gene reco [...] ', 'hns');
