INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4736448', '511145.b1323', '511145', 'DNA-binding transcriptional dual regulator, tyrosine-binding; Involved in transcriptional regulation of aromatic amino acid biosynthesis and transport. Modulates the expression of at least 8 unlinked operons. Seven of these operons are regulated in response to changes in the concentration of the three aromatic amino acids (phenylalanine, tyrosine and tryptophan). These amino acids are suggested to act as co-effectors which bind to the tyrR protein to form an active regulatory protein. In most cases tyrR causes negative regulation, but positive effects on the tyrP gene have been observe [...] ', 'tyrR');
