INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737214', '511145.b2161', '511145', 'nucleoside permease; Nucleoside transporter', 'nupX');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737215', '511145.b2162', '511145', 'ribonucleoside hydrolase 2; Hydrolyzes cytidine or uridine to ribose and cytosine or uracil, respectively. Has a clear preference for cytidine over uridine. Strictly specific for ribonucleosides. Has a low but significant activity for the purine nucleoside xanthosine', 'rihB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737216', '511145.b2163', '511145', 'DNA-binding transcriptional activator of stationary phase nitrogen survival; Transcription regulator involved in mid-term, stationary-phase viability under nitrogen starvation. Might control expression of the salvage pathways or in some other way repress the recycling of nucleobases to nucleic acids and enhance their use as general nitrogen sources during nitrogen-limited growth', 'nsr');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737217', '511145.b2164', '511145', 'predicted nucleoside transporter; Could be involved in pseudouridine transport', 'psuT');
