INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737220', '511145.b2167', '511145', 'fused fructose-specific PTS enzymes: IIBcomponent/IIC components; The phosphoenolpyruvate-dependent sugar phosphotransferase system (sugar PTS), a major carbohydrate active -transport system, catalyzes the phosphorylation of incoming sugar substrates concomitantly with their translocation across the cell membrane. This system is involved in fructose transport', 'fruA');
