INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737223', '511145.b2170', '511145', 'lactose/glucose efflux system; Involved in the efflux of sugars. The physiological role may be the detoxification of non-metabolizable sugar analogs. Can transport lactose and glucose', 'setB');
