INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737237', '511145.b2184', '511145', 'predicted ATP-dependet helicase', 'yejH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737238', '511145.b2185', '511145', '50S ribosomal subunit protein L25; This is one of the proteins that binds to the 5S RNA in the ribosome where it forms part of the central protuberance. Binds to the 5S rRNA independently of L5 and L18. Not required for binding of the 5S rRNA/L5/L18 subcomplex to 23S rRNA', 'rplY');
