INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737243', '511145.b2193', '511145', 'DNA-binding response regulator in two-component regulatory system with NarQ or NarX; This protein activates the expression of the nitrate reductase (narGHJI) and formate dehydrogenase-N (fdnGHI) operons and represses the transcription of the fumarate reductase (frdABCD) operon in response to a nitrate/nitrite induction signal transmitted by either the narX or narQ proteins', 'narP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737244', '511145.b2194', '511145', 'heme lyase, CcmH subunit; May be required for the biogenesis of c-type cytochromes. Possible subunit of a heme lyase', 'ccmH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737245', '511145.b2195', '511145', 'periplasmic thioredoxin of cytochrome c-type biogenesis; Involved in disulfide bond formation. Catalyzes a late, reductive step in the assembly of periplasmic c-type cytochromes, probably the reduction of disulfide bonds of the apocytochrome c to allow covalent linkage with the heme. Possible subunit of a heme lyase. DsbE is maintained in a reduced state by dsbD', 'ccmG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737246', '511145.b2196', '511145', 'heme lyase, CcmF subunit; Required for the biogenesis of c-type cytochromes. Possible subunit of a heme lyase', 'ccmF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737247', '511145.b2197', '511145', 'periplasmic heme chaperone; Heme chaperone required for the biogenesis of c-type cytochromes. Transiently binds heme delivered by ccmC and transfers the heme to apo-cytochromes in a process facilitated by ccmF and ccmH', 'ccmE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737248', '511145.b2198', '511145', 'cytochrome c biogenesis protein; Required for the export of heme to the periplasm for the biogenesis of c-type cytochromes (Potential)', 'ccmD');
