INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737251', '511145.b2201', '511145', 'heme exporter subunit; Part of the ABC transporter complex ccmAB involved in the biogenesis of c-type cytochromes; once thought to export heme, this seems not to be the case, but its exact role is uncertain. Responsible for energy coupling to the transport system (By similarity)', 'ccmA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737252', '511145.b2202', '511145', 'Quinol dehydrogenase, electron source for NapAB; Mediates electron flow from quinones to the napAB complex', 'napC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737253', '511145.b2203', '511145', 'nitrate reductase, small, cytochrome C550 subunit, periplasmic; Small subunit of the periplasmic nitrate reductase (NAP). Only expressed at high levels during aerobic growth. NapAB complex receives electrons from the membrane-anchored tetraheme napC protein, thus allowing electron flow between membrane and periplasm. Essential function for nitrate assimilation and may have a role in anaerobic metabolism (By similarity)', 'napB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737254', '511145.b2204', '511145', 'ferredoxin-type protein essential for electron transfer from ubiquinol to periplasmic nitrate reductase (NapAB); Involved in electron transfer', 'napH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737255', '511145.b2205', '511145', 'ferredoxin-type protein essential for electron transfer from ubiquinol to periplasmic nitrate reductase (NapAB); Involved in electron transfer (Probable)', 'napG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737256', '511145.b2206', '511145', 'nitrate reductase, periplasmic, large subunit; Catalytic subunit of the periplasmic nitrate reductase (NAP). Only expressed at high levels during aerobic growth. NapAB complex receives electrons from the membrane-anchored tetraheme protein napC, thus allowing electron flow between membrane and periplasm. Essential function for nitrate assimilation and may have a role in anaerobic metabolism (By similarity)', 'napA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737257', '511145.b2207', '511145', 'assembly protein for periplasmic nitrate reductase; Plays a role in the correct assembly of subunits of the periplasmic napAB enzyme', 'napD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737258', '511145.b2208', '511145', 'ferredoxin-type protein, role in electron transfer to periplasmic nitrate reductase NapA; Involved in electron transfer', 'napF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737259', '511145.b2209', '511145', 'ecotin, a serine protease inhibitor; General inhibitor of pancreatic serine proteases: inhibits chymotrypsin, trypsin, elastases, factor X, kallikrein as well as a variety of other proteases. The strength of inhibition does not appear to be correlated with a particular protease specificity', 'eco');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737260', '511145.b2210', '511145', 'malate dehydrogenase, FAD/NAD(P)-binding domain', 'mqo');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737261', '511145.b2211', '511145', 'Microcin J25 efflux pump, TolC-dependent; fused ABC transporter permease and ATP-binding components; Mediates resistance to the antibacterial peptide microcin J25. Functions as an efflux pump for microcin J25. Requires tolC for export of microcin J25', 'yojI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737262', '511145.b2212', '511145', 'oxidative demethylase of N1-methyladenine or N3-methylcytosine DNA lesions; Dioxygenase that repairs alkylated DNA and RNA containing 1-methyladenine and 3-methylcytosine by oxidative demethylation. Accepts double-stranded and single-stranded substrates. Requires molecular oxygen, alpha-ketoglutarate and iron. Provides extensive resistance to alkylating agents such as MMS and DMS (SN2 agents), but not to MMNG and MNU (SN1 agents)', 'alkB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737295', '511145.b2248', '511145', 'predicted DNA-binding transcriptional regulator', 'yfaX');
