INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737263', '511145.b2213', '511145', 'fused DNA-binding transcriptional dual regulator/O6-methylguanine-DNA methyltransferase; Repair of alkylated guanine in DNA by stoichiometrically transferring the alkyl group at the O-6 position to a cysteine residue in the enzyme. This is a suicide reaction: the enzyme is irreversibly inactivated. Can also repair O-4-methylthymine', 'ada');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737264', '511145.b2214', '511145', 'predicted thiamine biosynthesis lipoprotein; Involved in the conversion of aminoimidazole ribotide (AIR), a purine intermediate, to the 4-amino-5-hydroxymethyl-2- methyl pyrimidine (HMP) moiety of thiamine (By similarity)', 'apbE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737265', '511145.b2215', '511145', 'outer membrane porin protein C; Forms passive diffusion pores which allow small molecular weight hydrophilic materials across the outer membrane', 'ompC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737266', '511145.b2216', '511145', 'phosphotransfer intermediate protein in two-component regulatory system with RcsBC; May serves as a phosphotransfer intermediate between rcsC and rcsB. It may acquire a phosphoryl group at His-842 from rcsC ''Asp-866'' and transmit it to ''Asp-56'' of rcsB', 'yojN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737267', '511145.b2217', '511145', 'DNA-binding response regulator in two-component regulatory system with RcsC and YojN; RcsB is a member of the two-component regulatory system rcsB/rcsC, which regulates the expression of genes involved in colanic acid capsule synthesis. The two-component system interacts with a phosphotransfer intermediate, yojN, which receives a phosphoryl group from rcsC and transfers it to rscB. RcsB acts as the effector. Additional control is provided by the dependence on the alternate sigma factor, rpoN, for the synthesis of rcsB. RcsA and rcsB form a complex to promote transcription of the genes  [...] ', 'rcsB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737268', '511145.b2218', '511145', 'hybrid sensory kinase in two-component regulatory system with RcsB and YojN; Member of the two-component regulatory system rcsC/rcsB involved in the regulation of the expression of genes involved in colanic acid capsule synthesis. Together with rcsF, rcsC probably functions as a membrane-associated protein kinase that phosphorylates rcsB in response to environmental signals. The two- component system interacts with a phosphotransfer intermediate, yojN, which receives a phosphoryl group from rcsC and transfers it to rscB', 'rcsC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737269', '511145.b2219', '511145', 'sensory histidine kinase in two-component regulatory system with AtoC; Member of the two-component regulatory system atoS/atoC; may activate atoC by phosphorylation', 'atoS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737270', '511145.b2220', '511145', 'fused response regulator of ato operon, in two-component system with AtoS: response regulator/sigma54 interaction protein; Member of the two-component regulatory system atoS/atoC involved in the transcriptional regulation of the ato genes for acetoacetate metabolism. Also an inhibitor of polyamine biosynthesis', 'atoC');
