INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737286', '511145.b2239', '511145', 'periplasmic glycerophosphodiester phosphodiesterase; Glycerophosphoryl diester phosphodiesterase hydrolyzes deacylated phospholipids to G3P and the corresponding alcohols', 'glpQ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737287', '511145.b2240', '511145', 'sn-glycerol-3-phosphate transporter; Responsible for glycerol-3-phosphate uptake', 'glpT');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737288', '511145.b2241', '511145', 'sn-glycerol-3-phosphate dehydrogenase (anaerobic), large subunit, FAD/NAD(P)-binding; Conversion of glycerol 3-phosphate to dihydroxyacetone. Uses fumarate or nitrate as electron acceptor', 'glpA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737289', '511145.b2242', '511145', 'sn-glycerol-3-phosphate dehydrogenase (anaerobic), membrane anchor subunit; Conversion of glycerol 3-phosphate to dihydroxyacetone. Uses fumarate or nitrate as electron acceptor', 'glpB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737290', '511145.b2243', '511145', 'sn-glycerol-3-phosphate dehydrogenase (anaerobic), small subunit; Electron transfer protein; may also function as the membrane anchor for the glpAB dimer', 'glpC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737291', '511145.b2244', '511145', 'conserved protein', 'yfaD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737292', '511145.b2245', '511145', '2-keto-3-deoxy-L-rhamnonate aldolase; Catalyzes the reversible retro-aldol cleavage of 2-keto- 3-deoxy-L-rhamnonate (KDR) to pyruvate and lactaldehyde. 2-keto-3- deoxy-L-mannonate, 2-keto-3-deoxy-L-lyxonate and 4-hydroxy-2- ketoheptane-1,7-dioate (HKHD) are also reasonably good substrates, although 2-keto-3-deoxy-L-rhamnonate is likely to be the physiological substrate', 'yfaU');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737293', '511145.b2246', '511145', 'predicted transporter', 'yfaV');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737294', '511145.b2247', '511145', 'predicted enolase; Catalyzes the dehydration of L-rhamnonate to 2-keto-3- deoxy-L-rhamnonate (KDR). Can also dehydrate L-lyxonate, L- mannonate and D-gulonate, although less efficiently, but not 2- keto-4-hydroxyheptane-1,7-dioate', 'yfaW');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737298', '511145.b2251', '511145', 'nucleoside triphosphatase; Catalyzes the hydrolysis of nucleoside triphosphates, with a preference for pyrimidine deoxynucleoside triphosphates (dUTP, dTTP and dCTP)', 'nudI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737299', '511145.b2252', '511145', 'conserved protein; Catalyzes the dephosphorylation of heptose(II) of the outer membrane lipopolysaccharide core (By similarity)', 'ais');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737300', '511145.b2253', '511145', 'uridine 5''-(beta-1-threo-pentapyranosyl-4-ulose diphosphate) aminotransferase, PLP-dependent; Catalyzes the conversion of UDP-4-keto-arabinose (UDP- Ara4O) to UDP-4-amino-4-deoxy-L-arabinose (UDP-L-Ara4N). The modified arabinose is attached to lipid A and is required for resistance to polymyxin and cationic antimicrobial peptides', 'arnB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737301', '511145.b2254', '511145', 'undecaprenyl phosphate-L-Ara4FN transferase; Catalyzes the transfer of 4-deoxy-4-formamido-L- arabinose from UDP to undecaprenyl phosphate. The modified arabinose is attached to lipid A and is required for resistance to polymyxin and cationic antimicrobial peptides', 'arnC');
