INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737551', '511145.b2518', '511145', 'multifunctional nucleoside diphosphate kinase and apyrimidinic endonuclease and 3''-phosphodiesterase; Major role in the synthesis of nucleoside triphosphates other than ATP. The ATP gamma phosphate is transferred to the NDP beta phosphate via a ping-pong mechanism, using a phosphorylated active-site intermediate', 'ndk');
