INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737558', '511145.b2525', '511145', '[2Fe-2S] ferredoxin; Ferredoxin are iron-sulfur proteins that transfer electrons in a wide variety of metabolic reactions. Although the function of this ferredoxin is unknown it is probable that it has a role as a cellular electron transfer protein. Involved in the in vivo assembly of the Fe-S clusters in a wide variety of iron- sulfur proteins', 'fdx');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737559', '511145.b2526', '511145', 'DnaK-like molecular chaperone specific for IscU; Chaperone involved in the maturation of iron-sulfur cluster-containing proteins. Has a low intrinsic ATPase activity which is markedly stimulated by hscB. Involved in the maturation of iscU', 'hscA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737560', '511145.b2527', '511145', 'DnaJ-like molecular chaperone specific for IscU; Co-chaperone involved in the maturation of iron-sulfur cluster-containing proteins. Seems to help targeting proteins to be folded toward hscA', 'hscB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737561', '511145.b2528', '511145', 'FeS cluster assembly protein; Is able to transfer iron-sulfur clusters to apo- ferredoxin. Multiple cycles of [2Fe2S] cluster formation and transfer are observed, suggesting that iscA acts catalytically. Recruits intracellular free iron so as to provide iron for the assembly of transient iron-sulfur cluster in iscU in the presence of iscS, L-cysteine and the thioredoxin reductase system trxA/trxB', 'iscA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737562', '511145.b2529', '511145', 'scaffold protein; May be involved in the formation or repair of [Fe-S] clusters present in iron-sulfur proteins (Potential)', 'nifU');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737563', '511145.b2530', '511145', 'cysteine desulfurase (tRNA sulfurtransferase), PLP-dependent; Catalyzes the removal of elemental sulfur and selenium atoms from cysteine and selenocysteine to produce alanine. Functions as a sulfur delivery protein for NAD, biotin and Fe-S cluster synthesis. Transfers sulfur on ''Cys-456'' of thiI in a transpersulfidation reaction. Transfers sulfur on ''Cys-19'' of tusA in a transpersulfidation reaction. Functions also as a selenium delivery protein in the pathway for the biosynthesis of selenophosphate', 'iscS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737739', '511145.b2736', '511145', 'predicted dehydrogenase, with NAD(P)-binding Rossmann-fold domain', 'ygbJ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737564', '511145.b2531', '511145', 'DNA-binding transcriptional repressor; Regulates the transcription of several operons and genes involved in the biogenesis of Fe-S clusters and Fe-S-containing proteins. Transcriptional repressor of the iscRSUA operon, which is involved in the assembly of Fe-S clusters into Fe-S proteins. In its apoform, under conditions of oxidative stress or iron deprivation, it activates the suf operon, which is a second operon involved in the assembly of Fe-S clusters. Represses its own transcription', 'iscR');
