INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737699', '511145.b2696', '511145', 'pleiotropic regulatory protein for carbon source metabolism; Affects glycogen biosynthesis, gluconeogenesis, cell size and surface properties. Regulates glycogen synthesis under both aerobic and anaerobic conditions. Seems to accelerate the degradation of glg gene transcripts, potentially through selective RNA binding. Acts to inhibit interaction between the letD protein and the A subunit of DNA gyrase. Also required for motility and flagellum biosynthesis through the post-transcriptional activation of flhDC expression. This involves binding to and stabilization of the flhDC message by csrA', 'csrA');
