INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737715', '511145.b2712', '511145', 'carbamoyl phosphate phosphatase and maturation protein for [NiFe] hydrogenases; Along with hypE, it catalyzes the synthesis of the CN ligands of the active site iron of [NiFe]-hydrogenases using carbamoylphosphate as a substrate. It functions as a carbamoyl transferase using carbamoylphosphate as a substrate and transferring the carboxamido moiety in an ATP-dependent reaction to the thiolate of the C-terminal cysteine of hypE yielding a protein-S-carboxamide', 'hypF');
