INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737803', '511145.b2802', '511145', 'L-fucose isomerase; Converts the aldose L-fucose into the corresponding ketose L-fuculose. Is also able to convert D-arabinose into D- ribulose, but this isomerase has a higher affinity for fucose and fuculose than for arabinose and ribulose, respectively', 'fucI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737785', '511145.b2784', '511145', '(p)ppGpp synthetase I/GTP pyrophosphokinase; In eubacteria ppGpp (guanosine 3''-diphosphate 5-'' diphosphate) is a mediator of the stringent response that coordinates a variety of cellular activities in response to changes in nutritional abundance. This enzyme catalyzes the formation of pppGpp which is then hydrolyzed to form ppGpp', 'relA');
