INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737787', '511145.b2786', '511145', 'hybrid sensory histidine kinase, in two-component regulatory system with UvrY; Member of the two-component regulatory system uvrY/barA involved in the regulation of carbon metabolism via the csrA/csrB regulatory system. Phosphorylates uvrY, probably via a four-step phosphorelay', 'barA');
