INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737817', '511145.b2819', '511145', 'exonuclease V (RecBCD complex), alpha chain; Exhibits several catalytic activities, including ATP- dependent exonuclease, ATP-stimulated endonuclease, ATP-dependent unwinding and DNA-dependent ATPase activities. Strand cleavage occurs 5'' to 3'' during the unwinding of duplex DNA at CHI sequences, which locally stimulate recombination', 'recD');
