INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737827', '511145.b2829', '511145', 'fused PTS enzyme: PEP-protein phosphotransferase (enzyme I)/GAF domain containing protein; Component of the phosphoenolpyruvate-dependent nitrogen- metabolic phosphotransferase system (nitrogen-metabolic PTS), that seems to be involved in regulating nitrogen metabolism. Enzyme I- Ntr transfers the phosphoryl group from phosphoenolpyruvate (PEP) to the phosphoryl carrier protein (NPr). Could function in the transcriptional regulation of sigma-54 dependent operons in conjunction with the NPr (ptsO) and EIIA-Ntr (ptsN) proteins', 'ptsP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4737828', '511145.b2830', '511145', 'nucleotide hydrolase; Master regulator of 5''-dependent mRNA decay. Accelerates the degradation of transcripts by removing pyrophosphate from the 5''-end of triphosphorylated RNA, leading to a more labile monophosphorylated state that can stimulate subsequent ribonuclease cleavage. Preferentially hydrolyzes diadenosine penta-phosphate with ATP as one of the reaction products. Also able to hydrolyze diadenosine hexa- and tetra-phosphate. Has no activity on diadenosine tri-phosphate, ADP-ribose, NADH and UDP- glucose. In the meningitis causing strain E.coli K1, has been shown to play a rol [...] ', 'rppH');
