INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738120', '511145.b3163', '511145', 'conserved protein; May be involved in cell division. Overexpression of nlpI results in the loss of the rod morphology and the formation of single prolate ellipsoids and pairs of prolate ellipsoids joined by partial constrictions', 'nlpI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738121', '511145.b3164', '511145', 'polynucleotide phosphorylase/polyadenylase; Involved in mRNA degradation. Hydrolyzes single-stranded polyribonucleotides processively in the 3''- to 5''-direction', 'pnp');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738122', '511145.b3165', '511145', '30S ribosomal subunit protein S15; One of the primary rRNA binding proteins, it binds directly to 16S rRNA where it helps nucleate assembly of the platform of the 30S subunit by binding and bridging several RNA helices of the 16S rRNA (By similarity)', 'rpsO');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738123', '511145.b3166', '511145', 'tRNA U55 pseudouridine synthase; Responsible for synthesis of pseudouridine from uracil- 55 in the psi GC loop of transfer RNAs (By similarity)', 'truB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738197', '511145.b3243', '511145', 'transcriptional regulator for aaeXAB operon; Activates transcription of the aaeXAB operon', 'aaeR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738124', '511145.b3167', '511145', '30S ribosome binding factor; Essential for efficient processing of 16S rRNA. Probably part of the 30S subunit prior to or during the final step in the processing of 16S free 30S ribosomal subunits. Could be some accessory protein needed for efficient assembly of the 30S subunit. May interact with the 5''-terminal helix region of 16S rRNA. Has affinity for free ribosomal 30S subunits but not for 70S ribosomes. Overexpression suppresses rimM deletion mutants', 'rbfA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738125', '511145.b3168', '511145', 'fused protein chain initiation factor 2, IF2: membrane protein/conserved protein; One of the essential components for the initiation of protein synthesis. Protects formylmethionyl-tRNA from spontaneous hydrolysis and promotes its binding to the 30S ribosomal subunits. Also involved in the hydrolysis of GTP during the formation of the 70S ribosomal complex (By similarity)', 'infB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738126', '511145.b3169', '511145', 'transcription termination/antitermination L factor; Participates in both the termination and antitermination of transcription. NusA binds directly to the core enzyme of the DNA-dependent RNA polymerase. NusA also interacts with lambda N protein, RNA, rho factor, and perhaps nusB. Binds RNA', 'nusA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738127', '511145.b3170', '511145', 'conserved protein; Required for maturation of 30S ribosomal subunits', 'rimP');
