INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738131', '511145.b3176', '511145', 'phosphoglucosamine mutase; Catalyzes the conversion of glucosamine-6-phosphate to glucosamine-1-phosphate. Can also catalyze the formation of glucose-6-P from glucose-1-P, although at a 1400-fold lower rate', 'glmM');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738132', '511145.b3177', '511145', '7,8-dihydropteroate synthase; DHPS catalyzes the formation of the immediate precursor of folic acid. It is implicated in resistance to sulfonamide', 'dhps');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738133', '511145.b3178', '511145', 'protease, ATP-dependent zinc-metallo; Seems to act as an ATP-dependent zinc metallopeptidase. Involved in the degradation of sigma-32. Degrades C-terminal- tagged cytoplasmic proteins. These proteins are tagged with an 11- amino-acid nonpolar destabilizing tail via a mechanism involving the 10SA (ssrA) stable RNA', 'ftsH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738134', '511145.b3179', '511145', '23S rRNA methyltransferase; Specifically methylates the uridine in position 2552 of 23S rRNA in the fully assembled 50S ribosomal subunit (By similarity)', 'rlmE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738135', '511145.b3180', '511145', 'predicted RNA-binding protein', 'yhbY');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738136', '511145.b3181', '511145', 'transcript cleavage factor; Necessary for efficient RNA polymerase transcription elongation past template-encoded arresting sites. The arresting sites in DNA have the property of trapping a certain fraction of elongating RNA polymerases that pass through, resulting in locked ternary complexes. Cleavage of the nascent transcript by cleavage factors such as greA or greB allows the resumption of elongation from the new 3''terminus. GreA releases sequences of 2 to 3 nucleotides', 'greA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738137', '511145.b3182', '511145', 'D-alanyl-D-alanine carboxypeptidase; Not involved in transpeptidation but exclusively catalyzes a DD-carboxypeptidase and DD-endopeptidase reaction', 'dacB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738177', '511145.b3223', '511145', 'predicted N-acetylmannosamine-6-P epimerase; Converts N-acetylmannosamine-6-phosphate (ManNAc-6-P) to N-acetylglucosamine-6-phosphate (GlcNAc-6-P)  (By similarity)', 'nanE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738138', '511145.b3183', '511145', 'GTPase involved in cell partioning and DNA repair; An abundant, essential GTPase which binds GTP, GDP and ppGpp with moderate affinity, shows high guanine nucleotide exchange rate constants for GTP and GDP, and has a relatively low GTP hydrolysis rate. It is estimated there are 34000 molecules in log-phase cells and 5600 molecules in stationary-phase cells as the monomer. Required for chromosome segregation. It also plays a role in the stringent response, and a non-essential role in the late steps of ribosome biogenesis, but how it performs these functions remains unelucidated', 'obgE');
