INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738155', '511145.b3200', '511145', 'periplasmic LPS-binding protein; Required for the translocation of lipopolysaccharide (LPS) from the inner membrane to the outer membrane. May act as a chaperone that facilitates LPS transfer across the aquaeous environment of the periplasm. Interacts specifically with the lipid A domain of LPS', 'lptA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738156', '511145.b3201', '511145', 'predicted transporter subunit: ATP-binding component of ABC superfamily; Part of the ABC transporter complex lptBFG involved in the translocation of lipopolysaccharide (LPS) from the inner membrane to the outer membrane. Probably responsible for energy coupling to the transport system', 'lptB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738178', '511145.b3224', '511145', 'sialic acid transporter; May be a sugar-cation symporter involved in sialic acid transport as it is required for sialic acid uptake', 'nanT');
