INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738157', '511145.b3202', '511145', 'RNA polymerase, sigma 54 (sigma N) factor; Sigma factors are initiation factors that promote the attachment of RNA polymerase to specific initiation sites and are then released. This sigma factor is responsible for the expression of enzymes involved in arginine catabolism. The open complex (sigma-54 and core RNA polymerase) serves as the receptor for the receipt of the melting signal from the remotely bound activator protein glnG(ntrC)', 'rpoN');
