INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738159', '511145.b3204', '511145', 'sugar-specific enzyme IIA component of PTS; Seems to have a role in regulating nitrogen assimilation (By similarity)', 'ptsN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738160', '511145.b3205', '511145', 'predicted protein with nucleoside triphosphate hydrolase domain; Displays ATPase and GTPase activities. Can also hydrolyze pNPP. May regulate expression of glmS, by affecting the processing and stability of a small RNA, glmZ', 'yhbJ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738161', '511145.b3206', '511145', 'phosphohistidinoprotein-hexose phosphotransferase component of N-regulated PTS system (Npr); Component of the phosphoenolpyruvate-dependent nitrogen- metabolic phosphotransferase system (nitrogen-metabolic PTS), that seems to be involved in regulating nitrogen metabolism. The phosphoryl group from phosphoenolpyruvate (PEP) is transferred to the phosphoryl carrier protein NPr by enzyme I-Ntr. Phospho-NPr then transfers it to EIIA-Ntr. Could function in the transcriptional regulation of sigma-54 dependent operons in conjunction with the NPr (ptsO) and EIIA-Ntr (ptsN) proteins', 'ptsO');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738162', '511145.b3207', '511145', 'predicted protein', 'yrbL');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738163', '511145.b3208', '511145', 'biosynthetic peptidoglycan transglycosylase; Cell wall formation (By similarity)', 'mtgA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738164', '511145.b3209', '511145', 'isoprenoid biosynthesis protein with amidotransferase-like domain; May be involved in the early steps of isoprenoid biosynthesis', 'elbB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738165', '511145.b3210', '511145', 'hybrid sensory histidine kinase in two-component regulatory system with ArcA; Member of the two-component regulatory system arcB/arcA. Sensor-regulator protein for anaerobic repression of the arc modulon. Activates arcA via a four-step phosphorelay. ArcB can also dephosphorylate arcA by a reverse phosphorelay involving His- 717 and Asp-576', 'arcB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738166', '511145.b3211', '511145', 'predicted Fe-S oxidoreductase', 'yhcC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738167', '511145.b3212', '511145', 'glutamate synthase, large subunit', 'gltB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738168', '511145.b3213', '511145', 'glutamate synthase, 4Fe-4S protein, small subunit', 'gltD');
