INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738180', '511145.b3226', '511145', 'DNA-binding transcriptional dual regulator; Transcriptional repressor of the nan operon that encodes proteins involved in sialic acid utilization', 'nanR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738181', '511145.b3227', '511145', 'predicted transporter; May have a role in the transport of dicarboxylates from the periplasm across the inner membrane. Seems not to be essential for growth. It is likely to be a cryptic gene, as no or low expression has been found under a number of growth conditions and when tested with a large number of potential substrates', 'dcuD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738182', '511145.b3228', '511145', 'ClpXP protease specificity-enhancing factor; Seems to act in concert with sspA in the regulation of several proteins during exponential and stationary-phase growth. The exact function of sspB is not yet known', 'sspB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738183', '511145.b3229', '511145', 'stringent starvation protein A; Forms an equimolar complex with the RNA polymerase holoenzyme (RNAP) but not with the core enzyme. It is synthesized predominantly when cells are exposed to amino acid starvation, at which time it accounts for over 50% of the total protein synthesized. It is involved in the transition from P1 early to P1 late gene expression. Rnk and sspA can functionally replace P.aeruginosa alginate regulatory gene algR2', 'sspA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738184', '511145.b3230', '511145', '30S ribosomal subunit protein S9; The C-terminal tail plays a role in the affinity of the 30S P site for different tRNAs. Mutations that decrease this affinity are suppressed in the 70S ribosome', 'rpsI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738185', '511145.b3231', '511145', '50S ribosomal subunit protein L13; This protein is one of the early assembly proteins of the 50S ribosomal subunit, although it is not seen to bind rRNA by itself. It is important during the early stages of 50S assembly', 'rplM');
