INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738191', '511145.b3237', '511145', 'DNA-binding transcriptional dual regulator, L-arginine-binding; Negatively controls the expression of the four operons of arginine biosynthesis in addition to the carAB operon. Predominantly interacts with A/T residues in ARG boxes. It also binds to a specific site in cer locus. Thus it is essential for cer-mediated site-specific recombination in ColE1. It is necessary for monomerization of the plasmid ColE1', 'argR');
