INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738210', '511145.b3259', '511145', 'methylase for 50S ribosomal subunit protein L11; Methylates ribosomal protein L11 (By similarity)', 'prmA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738211', '511145.b3260', '511145', 'tRNA-dihydrouridine synthase B; Catalyzes the synthesis of dihydrouridine, a modified base found in the D-loop of most tRNAs', 'dusB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738212', '511145.b3261', '511145', 'global DNA-binding transcriptional dual regulator; Activates ribosomal RNA transcription. Plays a direct role in upstream activation of rRNA promoters. Binds to a recombinational enhancer sequence that is required to stimulate hin-mediated DNA inversion. Prevents initiation of DNA replication from oriC', 'fis');
