INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738215', '511145.b3264', '511145', 'DNA-binding transcriptional regulator; Potential regulator protein for the acrEF/envCD genes', 'envR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738216', '511145.b3265', '511145', 'cytoplasmic membrane lipoprotein; May affect specific membrane functions, such as septum formation during cell division, and cell membrane permeability', 'acrE');
