INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738225', '511145.b3282', '511145', 'predicted ribosome maturation factor; Required for the maturation of 16S rRNA. May keep an rRNA structure needed for proper processing of 16S rRNA, especially at lower temperatures. Binds to double-stranded RNA but does not interact tightly with either of the ribosomal subunits, or the 70S particles', 'rimN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738226', '511145.b3283', '511145', 'predicted DNA topoisomerase', 'yrdD');
