INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738228', '511145.b3287', '511145', 'peptide deformylase; Removes the formyl group from the N-terminal Met of newly synthesized proteins. Requires at least a dipeptide for an efficient rate of reaction. N-terminal L-methionine is a prerequisite for activity but the enzyme has broad specificity at other positions', 'def');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738229', '511145.b3288', '511145', '10-formyltetrahydrofolate:L-methionyl-tRNA(fMet) N-formyltransferase; Modifies the free amino group of the aminoacyl moiety of methionyl-tRNA(fMet). The formyl group appears to play a dual role in the initiator identity of N-formylmethionyl-tRNA by: (I) promoting its recognition by IF2 and (II) impairing its binding to EFTu-GTP', 'fmt');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738230', '511145.b3289', '511145', '16S rRNA m(5)C967 methyltransferase, S-adenosyl-L-methionine-dependent; Specifically methylates the cytosine at position 967 (m5C967) of 16S rRNA', 'rsmB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738231', '511145.b3290', '511145', 'NAD-binding component of TrK potassium transporter; Part of the constitutive potassium transport systems trkG and trkH. May regulate the transport activity of trkG and trkH systems. Binds to NAD+ and NADH', 'trkA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738232', '511145.b3291', '511145', 'mechanosensitive channel; Mechanosensitive channel that opens in response to stretch forces in the membrane lipid bilayer. Participates in the regulation of osmotic pressure changes within the cell. Forms a nonselective ion channel of 2.5 nanosiemens conductance. Opens at a pressure just below that which would cause cell disruption and death', 'mscL');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738233', '511145.b3292', '511145', 'DNA-binding transcriptional activator in response to Zn(II); Zinc-responsive transcriptional regulator of zntA', 'zntR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738234', '511145.b3293', '511145', 'conserved protein', 'yhdN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738235', '511145.b3294', '511145', '50S ribosomal subunit protein L17; Requires L15 for assembly into the 50S subunit', 'rplQ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738250', '511145.b3309', '511145', '50S ribosomal subunit protein L24; One of two assembly inititator proteins, it binds directly to the 5''-end of the 23S rRNA, where it nucleates assembly of the 50S subunit. It is not thought to be involved in the functions of the mature 50S subunit in vitro', 'rplX');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738236', '511145.b3295', '511145', 'RNA polymerase, alpha subunit; DNA-dependent RNA polymerase catalyzes the transcription of DNA into RNA using the four ribonucleoside triphosphates as substrates. This subunit plays an important role in subunit assembly since its dimerization is the first step in the sequential assembly of subunits to form the holoenzyme', 'rpoA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738237', '511145.b3296', '511145', '30S ribosomal subunit protein S4; Also functions as a rho-dependent antiterminator of rRNA transcription, increasing the synthesis of rRNA under conditions of excess protein, allowing a more rapid return to homeostasis. Binds directly to RNA polymerase', 'rpsD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738238', '511145.b3297', '511145', '30S ribosomal subunit protein S11; Located on the platform of the 30S subunit, it bridges several disparate RNA helices of the 16S rRNA. Forms part of the Shine-Dalgarno cleft in the 70S ribosome (By similarity)', 'rpsK');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738239', '511145.b3298', '511145', '30S ribosomal subunit protein S13; Located at the top of the head of the 30S subunit, it contacts several helices of the 16S rRNA (By similarity)', 'rpsM');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738240', '511145.b3299', '511145', '50S ribosomal subunit protein L36', 'rpmJ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738241', '511145.b3300', '511145', 'preprotein translocase membrane subunit; Involved in protein export. Interacts with secA and secE to allow the translocation of proteins across the plasma membrane, by forming part of a channel', 'secY');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738242', '511145.b3301', '511145', '50S ribosomal subunit protein L15; This protein binds the 5S rRNA. It is required for the late stages of subunit assembly, and is essential for 5S rRNA assembly onto the ribosome', 'rplO');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738243', '511145.b3302', '511145', '50S ribosomal subunit protein L30', 'rpmD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738244', '511145.b3303', '511145', '30S ribosomal subunit protein S5; With S4 and S12 plays an important role in translational accuracy. Many suppressors of streptomycin-dependent mutants of protein S12 are found in this protein, some but not all of which decrease translational accuracy (ram, ribosomal ambiguity mutations)', 'rpsE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738245', '511145.b3304', '511145', '50S ribosomal subunit protein L18; This is one of the proteins that mediates the attachment of the 5S rRNA subcomplex onto the large ribosomal subunit where it forms part of the central protuberance. Binds stably to 5S rRNA; increases binding abilities of L5 in a cooperative fashion; both proteins together confer 23S rRNA binding. The 5S rRNA and some of its associated proteins might help stabilize positioning of ribosome-bound tRNAs', 'rplR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738246', '511145.b3305', '511145', '50S ribosomal subunit protein L6; This protein binds directly to at least 2 domains of the 23S ribosomal RNA, thus is important in its secondary structure. It is located near the subunit interface in the base of the L7/L12 stalk, and near the tRNA binding site of the peptidyltransferase center', 'rplF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738247', '511145.b3306', '511145', '30S ribosomal subunit protein S8; One of the primary rRNA binding proteins, it binds directly to 16S rRNA central domain where it helps coordinate assembly of the platform of the 30S subunit (By similarity)', 'rpsH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738248', '511145.b3307', '511145', '30S ribosomal subunit protein S14; Binds 16S rRNA, required for the assembly of 30S particles and may also be responsible for determining the conformation of the 16S rRNA at the A site', 'rpsN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738249', '511145.b3308', '511145', '50S ribosomal subunit protein L5; This is 1 of the proteins that binds and probably mediates the attachment of the 5S RNA into the large ribosomal subunit, where it forms part of the central protuberance. In the 70S ribosome it contacts protein S13 of the 30S subunit (bridge B1b), connecting the 2 subunits; this bridge is implicated in subunit movement (By similarity)', 'rplE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738262', '511145.b3321', '511145', '30S ribosomal subunit protein S10; Involved in the binding of tRNA to the ribosomes', 'rpsJ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738251', '511145.b3310', '511145', '50S ribosomal subunit protein L14; This protein binds directly to 23S ribosomal RNA. In the E.coli 70S ribosome (PubMed:12809609) it has been modeled to make two contacts with the 16S rRNA of the 30S subunit, forming part of bridges B5 and B8, connecting the 2 subunits. Although the protein undergoes significant rotation during the transition from an initiation to and EF-G bound state, the bridges remain stable. In the 3.5 A resolved structures (PubMed:16272117) L14 and L19 interact and together make contact with the 16S rRNA in bridges B5 and B8', 'rplN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738252', '511145.b3311', '511145', '30S ribosomal subunit protein S17; One of the primary rRNA binding proteins, it binds specifically to the 5''-end of 16S ribosomal RNA. Also plays a role in translational accuracy; neamine-resistant ribosomes show reduced neamine-induced misreading in vitro', 'rpsQ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738253', '511145.b3312', '511145', '50S ribosomal subunit protein L29; Binds 23S rRNA. It is not essential for growth', 'rpmC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738254', '511145.b3313', '511145', '50S ribosomal subunit protein L16; This protein binds directly to 23S ribosomal RNA and is located at the A site of the peptidyltransferase center. It contacts the A and P site tRNAs. It has an essential role in subunit assembly, which is not well understood', 'rplP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738255', '511145.b3314', '511145', '30S ribosomal subunit protein S3; Binds the lower part of the 30S subunit head. Binds mRNA in the 70S ribosome, positioning it for translation (By similarity)', 'rpsC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738256', '511145.b3315', '511145', '50S ribosomal subunit protein L22; This protein binds specifically to 23S rRNA; its binding is stimulated by other ribosomal proteins, e.g., L4, L17, and L20. It is important during the early stages of 50S assembly. It makes multiple contacts with different domains of the 23S rRNA in the assembled 50S subunit and ribosome (By similarity)', 'rplV');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738257', '511145.b3316', '511145', '30S ribosomal subunit protein S19; In the E.coli 70S ribosome in the initiation state (PubMed:12809609) it has been modeled to contact the 23S rRNA of the 50S subunit forming part of bridge B1a; this bridge is broken in the model with bound EF-G. The 23S rRNA contact site in bridge B1a is modeled to differ in different ribosomal states (PubMed:12859903), contacting alternately S13 or S19. In the 3.5 angstroms resolved ribosome structures (PubMed:16272117) the contacts between L5, S13 and S19 bridge B1b are different, confirming the dynamic nature of this interaction. Bridge B1a is not  [...] ', 'rpsS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738258', '511145.b3317', '511145', '50S ribosomal subunit protein L2; One of the primary rRNA binding proteins. Located near the base of the L1 stalk, it is probably also mobile. Required for association of the 30S and 50S subunits to form the 70S ribosome, for tRNA binding and peptide bond formation. It has been suggested to have peptidyltransferase activity; this is highly controversial', 'rplB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738259', '511145.b3318', '511145', '50S ribosomal subunit protein L23; One of the early assembly protein, it binds 23S rRNA; is essential for growth. One of the proteins that surrounds the polypeptide exit tunnel on the outside of the subunit. Acts as the docking site for trigger factor (PubMed:12226666) for Ffh binding to the ribosome (SRP54, PubMed:12756233 and PubMed:12702815) and to nascent polypeptide chains (PubMed:12756233)', 'rplW');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738260', '511145.b3319', '511145', '50S ribosomal subunit protein L4; One of the primary rRNA binding proteins, this protein initially binds near the 5''-end of the 23S rRNA. It is important during the early stages of 50S assembly. It makes multiple contacts with different domains of the 23S rRNA in the assembled 50S subunit and ribosome', 'rplD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738261', '511145.b3320', '511145', '50S ribosomal subunit protein L3; One of the primary rRNA binding proteins, it binds directly near the 3''-end of the 23S rRNA, where it nucleates assembly of the 50S subunit (By similarity)', 'rplC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738263', '511145.b3322', '511145', 'part of gsp divergon involved in type II protein secretion; Calcium-binding protein that may be required for the initiation of chromosome replication', 'pioO');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738264', '511145.b3323', '511145', 'general secretory pathway component, cryptic; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'gspA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738265', '511145.b3324', '511145', 'general secretory pathway component, cryptic; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'gspC');
