INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738267', '511145.b3326', '511145', 'general secretory pathway component, cryptic; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'gspE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738268', '511145.b3327', '511145', 'general secretory pathway component, cryptic; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'hofF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738269', '511145.b3328', '511145', 'pseudopilin, cryptic, general secretion pathway; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'hofG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738270', '511145.b3329', '511145', 'predicted general secretory pathway component, cryptic; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'hofH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738271', '511145.b3330', '511145', 'general secretory pathway component, cryptic; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'gspI');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738272', '511145.b3331', '511145', 'predicted general secretory pathway component, cryptic; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'gspJ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738273', '511145.b3332', '511145', 'general secretory pathway component, cryptic; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'gspK');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738274', '511145.b3333', '511145', 'general secretory pathway component, cryptic; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'gspL');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738275', '511145.b3334', '511145', 'general secretory pathway component, cryptic; Involved in a general secretion pathway (GSP) for the export of proteins (By similarity)', 'pshM');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738276', '511145.b3335', '511145', 'bifunctional prepilin leader peptidase/ methylase; Cleaves type-4 fimbrial leader sequence and methylates the N-terminal (generally Phe) residue (By similarity)', 'hofD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738277', '511145.b3336', '511145', 'bacterioferritin, iron storage and detoxification protein; May perform analogous functions in iron detoxification and storage to that of animal ferritins', 'bfr');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738278', '511145.b3337', '511145', 'bacterioferritin-associated ferredoxin; Seems to associate with BFR; could be a general redox and/or regulatory component participating in the iron storage mobilization functions of BFR. Could participate in the release or the delivery of iron from/to bacterioferritin (or other iron complexes)', 'bfd');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738279', '511145.b3338', '511145', 'periplasmic endochitinase; Bifunctional enzyme with lysozyme/chitinase activity', 'chiA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738280', '511145.b3339', '511145', 'protein chain elongation factor EF-Tu (duplicate of TufB)', 'tufA');
