INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738299', '511145.b3358', '511145', 'conserved inner membrane protein', 'yhfK');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738300', '511145.b3359', '511145', 'bifunctional acetylornithine aminotransferase/ succinyldiaminopimelate aminotransferase; Involved in both the arginine and lysine biosynthetic pathways', 'argD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738282', '511145.b3341', '511145', '30S ribosomal subunit protein S7; One of the primary rRNA binding proteins, it binds directly to 16S rRNA where it nucleates assembly of the head domain of the 30S subunit. Is located at the subunit interface close to the decoding center, where it has been shown to contact mRNA. Has been shown to contact tRNA in both the P and E sites; it probably blocks exit of the E site tRNA', 'rpsG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738283', '511145.b3342', '511145', '30S ribosomal subunit protein S12; Interacts with and stabilizes bases of the 16S rRNA that are involved in tRNA selection in the A site and with the mRNA backbone. Located at the interface of the 30S and 50S subunits, it traverses the body of the 30S subunit contacting proteins on the other side and probably holding the rRNA structure together. The combined cluster of proteins S8, S12 and S17 appears to hold together the shoulder and platform of the 30S subunit (By similarity)', 'rpsL');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738284', '511145.b3343', '511145', 'predicted intracellular sulfur oxidation protein; Part of a sulfur-relay system required for 2-thiolation of 5-methylaminomethyl-2-thiouridine (mnm(5)s(2)U) at tRNA wobble positions (By similarity)', 'tusB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738285', '511145.b3344', '511145', 'predicted intraceullular sulfur oxidation protein; Part of a sulfur-relay system required for 2-thiolation of 5-methylaminomethyl-2-thiouridine (mnm(5)s(2)U) at tRNA wobble positions', 'tusC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738286', '511145.b3345', '511145', 'predicted intracellular sulfur oxidation protein; Part of a sulfur-relay system required for 2-thiolation of 5-methylaminomethyl-2-thiouridine (mnm(5)s(2)U) at tRNA wobble positions. Accepts sulfur from tusA and transfers it in turn to tusE', 'tusD');
