INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738289', '511145.b3348', '511145', 'conserved protein', 'slyX');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738290', '511145.b3349', '511145', 'FKBP-type peptidyl prolyl cis-trans isomerase (rotamase); Required for lysis of phiX174 infected cells. Binds nickel and zinc with high affinity and 1:1 stoichiometry, copper and cobalt with lower affinity. No binding detectable for ferrous, ferric, magnesium and calcium ions. The activity of slyD is considerably smaller than the one found in other PPIases with the same substrate. The substrate specificity carried out with ''suc- Ala-Xaa-Pro-Phe-4NA'', where Xaa is the AA tested, was found to be Phe > Ala > Leu', 'slyD');
