INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738301', '511145.b3360', '511145', 'aminodeoxychorismate synthase, subunit II; Catalyzes the biosynthesis of 4-amino-4-deoxychorismate (ADC) from chorismate and glutamine', 'pabA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738302', '511145.b3361', '511145', 'stationary-phase protein, cell division; Probable adenylyltransferase that mediates the addition of adenosine 5''-monophosphate (AMP) to specific residues of target proteins (By similarity). Involved in cell filamentation induced by cyclic AMP. May have some role in cell division', 'fic');
