INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738318', '511145.b3379', '511145', 'predicted hydrolase; Its real enzymatic activity is not yet known. It was tested for general esterase, aminopeptidase, sulfatase, phosphatase, carbonic anhydrase, phosphodiesterase, and phosphotriesterase activities with the following substrates: P- nitrophenyl acetate, L-alanine nitroanilide, P-nitrophenyl sulfate, bis(P-nitrophenyl) phosphate, paraoxon, and P-nitrophenyl phosphate. No enzymatic activity was detected with any of these nonspecific substrates', 'php');
