INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738324', '511145.b3385', '511145', 'phosphoglycolate phosphatase; Specifically catalyzes the dephosphorylation of 2- phosphoglycolate. Is involved in the dissimilation of the intracellular 2-phosphoglycolate formed during the DNA repair of 3''-phosphoglycolate ends, a major class of DNA lesions induced by oxidative stress (By similarity)', 'gph');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738325', '511145.b3386', '511145', 'D-ribulose-5-phosphate 3-epimerase', 'rpe');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738326', '511145.b3387', '511145', 'DNA adenine methylase; Methylates DNA within the sequence GATC and protects the DNA from cleavage by the restriction endonuclease MboI. Although it shares sequence specificity with a number of type II restriction endonucleases and methylases, it is thought to act in postreplication mismatch repair rather than as a part of a restriction modification system. May also play a role in DNA replication', 'dam');
