INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738334', '511145.b3395', '511145', 'predicted pilus assembly protein', 'yrfD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738335', '511145.b3396', '511145', 'fused penicillin-binding protein 1a: murein transglycosylase/murein transpeptidase; Cell wall formation. Synthesis of cross-linked peptidoglycan from the lipid intermediates. The enzyme has a penicillin-insensitive transglycosylase N-terminal domain (formation of linear glycan strands) and a penicillin-sensitive transpeptidase C-terminal domain (cross-linking of the peptide subunits)', 'mrcA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738336', '511145.b3397', '511145', 'ADP-ribose diphosphatase; Active on adenosine(5'')triphospho(5'')adenosine (Ap3A), ADP-ribose, NADH, adenosine(5'')diphospho(5'')adenosine (Ap2A)', 'nudE');
