INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738339', '511145.b3400', '511145', 'ribosome-associated heat shock protein HSP15; Involved in the recycling of free 50S ribosomal subunits that still carry a nascent chain. Binds RNA more specifically than DNA. Binds with very high affinity to the free 50S ribosomal subunit. Does not bind it when it is part of the 70S ribosome', 'hslR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738340', '511145.b3401', '511145', 'heat shock protein HSP33; Redox regulated molecular chaperone. Protects both thermally unfolding and oxidatively damaged proteins from irreversible aggregation. Plays an important role in the bacterial defense system toward oxidative stress', 'hslO');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738341', '511145.b3402', '511145', 'predicted inner membrane protein', 'yhgE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738342', '511145.b3403', '511145', 'phosphoenolpyruvate carboxykinase', 'pckA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738343', '511145.b3404', '511145', 'sensory histidine kinase in two-component regulatory system with OmpR; Member of the two-component regulatory system envZ/ompR involved in the regulation of osmoregulation (genes ompF and ompC). EnvZ functions as a membrane-associated protein kinase that phosphorylates ompR in response to environmental signals', 'envZ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738360', '511145.b3423', '511145', 'DNA-binding transcriptional repressor; Repressor of the glycerol-3-phosphate regulon', 'glpR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738489', '511145.b3561', '511145', 'conserved inner membrane protein', 'yiaH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738344', '511145.b3405', '511145', 'DNA-binding response regulator in two-component regulatory system with EnvZ; The N-terminus of this protein is required for the transcriptional expression of both major outer membrane protein genes ompF and ompC; its C-terminal moiety mediates the multimerization of the ompR protein. As a multimer, it turns on the expression of the ompC gene; as a monomer, it turns on the expression of the ompF gene', 'ompR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738345', '511145.b3406', '511145', 'transcript cleavage factor; Necessary for efficient RNA polymerase transcription elongation past template-encoded arresting sites. The arresting sites in DNA have the property of trapping a certain fraction of elongating RNA polymerases that pass through, resulting in locked ternary complexes. Cleavage of the nascent transcript by cleavage factors such as greA or greB allows the resumption of elongation from the new 3''terminus. GreB releases sequences of up to 9 nucleotides in length', 'greB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738346', '511145.b3407', '511145', 'predicted transcriptional accessory protein', 'yhgF');
