INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738348', '511145.b3409', '511145', 'fused ferrous iron transporter, protein B: GTP-binding protein/membrane protein; GTP-driven Fe(2+) uptake system', 'feoB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738349', '511145.b3410', '511145', 'predicted DNA-binding transcriptional regulator; May function as a transcriptional regulator that controls feoABC expression (By similarity)', 'feoC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738350', '511145.b3411', '511145', 'predicted transposase', 'yhgA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738351', '511145.b3412', '511145', 'carboxylesterase of pimeloyl-CoA synthesis; Shows carboxylesterase activity with a preference for short chain fatty acid esters (acyl chain length of up to 6 carbons). Also displays a weak thioesterase activity. Can form a complex with CoA, and may be involved in the condensation of CoA and pimelic acid into pimeloyl-CoA, a precursor in biotin biosynthesis', 'bioH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738352', '511145.b3413', '511145', 'protein required for the utilization of DNA as a carbon source; Could be involved in gluconate metabolism', 'gntX');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738353', '511145.b3414', '511145', 'predicted gluconate transport associated protein; Involved in iron-sulfur cluster biogenesis under severe conditions such as iron starvation or oxidative stress. Binds a 4Fe-4S cluster, can transfer this cluster to apoproteins, and thereby intervenes in the maturation of Fe/S proteins. Could also act as a scaffold/chaperone for damaged Fe/S proteins. Required for E.coli to sustain oxidative stress and iron starvation. Also necessary for the use of extracellular DNA as the sole source of carbon and energy', 'nfuA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738354', '511145.b3415', '511145', 'gluconate transporter, high-affinity GNT I system; Part of the gluconate utilization system Gnt-I; high- affinity intake of gluconate', 'gntT');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738355', '511145.b3416', '511145', '4-alpha-glucanotransferase (amylomaltase)', 'malQ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738356', '511145.b3417', '511145', 'maltodextrin phosphorylase; Phosphorylase is an important allosteric enzyme in carbohydrate metabolism. Enzymes from different sources differ in their regulatory mechanisms and in their natural substrates. However, all known phosphorylases share catalytic and structural properties (By similarity)', 'malP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738357', '511145.b3418', '511145', 'DNA-binding transcriptional activator for the mal regulon and maltotriose-ATP-binding protein; Positively regulates the transcription of the maltose regulon whose gene products are responsible for uptake and catabolism of malto-oligosaccharides. Binds and recognizes a DNA motif (called the malT box): 5''-GGA[TG]GA-3'' (By similarity)', 'malT');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738361', '511145.b3424', '511145', 'rhomboid intramembrane serine protease; Rhomboid-type serine protease that catalyzes intramembrane proteolysis', 'glpG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738362', '511145.b3425', '511145', 'thiosulfate:cyanide sulfurtransferase (rhodanese); Catalyzes, although with low efficiency, the sulfur transfer reaction from thiosulfate to cyanide. The relatively low affinity of glpE for both thiosulfate and cyanide suggests that these compounds are not the physiological substrates. Thioredoxin 1 or related dithiol proteins could instead be the physiological sulfur-acceptor substrate. Possible association with the metabolism of glycerol-phosphate remains to be elucidated', 'glpE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738363', '511145.b3426', '511145', 'sn-glycerol-3-phosphate dehydrogenase, aerobic, FAD/NAD(P)-binding; Conversion of glycerol 3-phosphate to dihydroxyacetone. Uses molecular oxygen or nitrate as electron acceptor', 'glpD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738364', '511145.b3428', '511145', 'glycogen phosphorylase; Phosphorylase is an important allosteric enzyme in carbohydrate metabolism. Enzymes from different sources differ in their regulatory mechanisms and in their natural substrates. However, all known phosphorylases share catalytic and structural properties (By similarity)', 'glgP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738365', '511145.b3429', '511145', 'glycogen synthase; Synthesizes alpha-1,4-glucan chains using ADP-glucose', 'glgA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738366', '511145.b3430', '511145', 'glucose-1-phosphate adenylyltransferase', 'glgC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738367', '511145.b3431', '511145', 'glycogen debranching enzyme; Hydrolyzes the alpha-1,6-glucosidic linkages in glycogen which has first been partially depolymerized by phosphorylase. Shows only very little activity with native glycogen', 'glgX');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738368', '511145.b3432', '511145', '1,4-alpha-glucan branching enzyme; Catalyzes the formation of the alpha-1,6-glucosidic linkages in glycogen by scission of a 1,4-alpha-linked oligosaccharide from growing alpha-1,4-glucan chains and the subsequent attachment of the oligosaccharide to the alpha-1,6 position. Has a preference for transferring chains of 5 to 16 glucose units', 'glgB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738369', '511145.b3433', '511145', 'aspartate-semialdehyde dehydrogenase, NAD(P)-binding', 'asd');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738370', '511145.b3434', '511145', 'predicted antibiotic transporter', 'yhgN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738371', '511145.b3437', '511145', 'gluconate kinase 2', 'gntK');
