INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738568', '511145.b3641', '511145', 'division inhibitor; Required for nucleoid occlusion (NO) phenomenon, which cooperates in the proper positioning of the ftsZ/septal ring at midcell during cell division. Acts as a DNA-associated division inhibitor directly involved in preventing Z ring assembly on portions of the membrane surrounding the nucleoid. The DNA-bound protein may mediate NO by directly interfering with Z ring formation in its vicinity', 'slmA');
