INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738620', '511145.b3700', '511145', 'gap repair protein; The recF protein is involved in DNA metabolism; it is required for DNA replication and normal SOS inducibility. RecF binds preferentially to single-stranded, linear DNA. It also seems to bind ATP (By similarity)', 'recF');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738621', '511145.b3701', '511145', 'DNA polymerase III, beta subunit; DNA polymerase III is a complex, multichain enzyme responsible for most of the replicative synthesis in bacteria. This DNA polymerase also exhibits 3'' to 5'' exonuclease activity. The beta chain is required for initiation of replication once it is clamped onto DNA, it slides freely (bidirectional and ATP- independent) along duplex DNA (By similarity)', 'dnaN');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738622', '511145.b3702', '511145', 'chromosomal replication initiator protein DnaA, DNA-binding transcriptional dual regulator; Plays an important role in the initiation and regulation of chromosomal replication. Binds to the origin of replication; it binds specifically double-stranded DNA at a 9 bp consensus (dnaA box): 5''-TTATC[CA]A[CA]A-3''. DnaA binds to ATP and to acidic phospholipids. DnaA can inhibit its own gene expression as well as that of other genes such as dam, rpoH, ftsA and mioC', 'dnaA');
