INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738624', '511145.b3704', '511145', 'protein C5 component of RNase P; RNaseP catalyzes the removal of the 5''-leader sequence from pre-tRNA to produce the mature 5''-terminus. It can also cleave other RNA substrates such as 4.5S RNA. The protein component plays an auxiliary but essential role in vivo by binding to the 5''-leader sequence and broadening the substrate specificity of the ribozyme', 'rnpA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738625', '511145.b3705', '511145', 'membrane protein insertase; Inner membrane protein required for the insertion of integral membrane proteins into the membrane. Probably plays an essential role in the integration of proteins of the respiratory chain complexes. Involved in integration of membrane proteins that insert dependently and independently of the Sec translocase complex. Essential for the integration of subunits a and c of the F(1)F(0)ATP synthase, and secE proteins', 'oxaA');
