INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738658', '511145.b3738', '511145', 'F0 sector of membrane-bound ATP synthase, subunit a; Key component of the proton channel; it plays a direct role in the translocation of protons across the membrane (By similarity)', 'atpB');
