INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738682', '511145.b3772', '511145', 'threonine deaminase; Catalyzes the formation of alpha-ketobutyrate from threonine in a two-step reaction. The first step is a dehydration of threonine, followed by rehydration and liberation of ammonia. Deaminates L-threonine, but also L-serine to a lesser extent', 'ilvA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738683', '511145.b3773', '511145', 'DNA-binding transcriptional dual regulator; This protein activates the transcription of the ilvC gene in the presence of acetolactate or acetohydroxybutyrate. IlvY is also a negative regulator of its own expression', 'ilvY');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738684', '511145.b3774', '511145', 'ketol-acid reductoisomerase, NAD(P)-binding', 'ilvC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738685', '511145.b3775', '511145', 'peptidyl-prolyl cis-trans isomerase C (rotamase C); PPIases accelerate the folding of proteins. It prefers amino acid residues with hydrophobic side chains like leucine and phenylalanine in the P1 position of the peptides substrates', 'ppiC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738686', '511145.b3778', '511145', 'DNA helicase and single-stranded DNA-dependent ATPase; Rep helicase is a single-stranded DNA-dependent ATPase involved in DNA replication; it can initiate unwinding at a nick in the DNA. It binds to the single-stranded DNA and acts in a progressive fashion along the DNA in the 3'' to 5'' direction', 'rep');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738687', '511145.b3779', '511145', 'guanosine pentaphosphatase/exopolyphosphatase; Conversion of pppGpp to ppGpp. Guanosine pentaphosphate (pppGpp) is a cytoplasmic signaling molecule which together with ppGpp controls the "stringent response", an adaptive process that allows bacteria to respond to amino acid starvation, resulting in the coordinated regulation of numerous cellular activities', 'gppA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738688', '511145.b3780', '511145', 'ATP-dependent RNA helicase; Can carry out ATP-dependent unwinding of double stranded RNA. Has a role in RNA decay. Involved in the RNA degradosome, a multi-enzyme complex important in RNA processing and messenger RNA degradation', 'rhlB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738689', '511145.b3781', '511145', 'thioredoxin 1; Participates in various redox reactions through the reversible oxidation of its active center dithiol to a disulfide and catalyzes dithiol-disulfide exchange reactions', 'trxA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738690', '511145.b3783', '511145', 'transcription termination factor; Facilitates transcription termination by a mechanism that involves rho binding to the nascent RNA, activation of rho''s RNA-dependent ATPase activity, and release of the mRNA from the DNA template. RNA-dependent NTPAse which utilizes all four ribonucleoside triphosphates as substrates', 'rho');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738691', '511145.b3784', '511145', 'UDP-GlcNAc:undecaprenylphosphate GlcNAc-1-phosphate transferase; Catalyzes the synthesis of Und-PP-GlcNAc (Lipid I), the first lipid-linked intermediate involved in ECA synthesis. This lipid is also an acceptor for the addition of subsequent sugars to complete the biosynthesis of O-antigen', 'wecA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738692', '511145.b3785', '511145', 'Entobacterial Common Antigen (ECA) polysaccharide chain length modulation protein', 'wzzE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738693', '511145.b3786', '511145', 'UDP-N-acetyl glucosamine-2-epimerase; Catalyzes the reversible epimerization at C-2 of UDP-N- acetylglucosamine (UDP-GlcNAc) and thereby provides bacteria with UDP-N-acetylmannosamine (UDP-ManNAc), the activated donor of ManNAc residues. Also involved in bacteriophage N4 adsorption', 'wecB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738694', '511145.b3787', '511145', 'UDP-N-acetyl-D-mannosaminuronic acid dehydrogenase; Catalyzes the four-electron oxidation of UDP-N-acetyl-D- mannosamine (UDP-ManNAc), reducing NAD(+) and releasing UDP-N- acetylmannosaminuronic acid (UDP-ManNAcA)', 'wecC');
