INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738697', '511145.b3790', '511145', 'TDP-fucosamine acetyltransferase; Transaminase converting thymidine diphosphate(TDP)-4- keto-6-deoxy-D-glucose to TDP-4-amino-4,6-dideoxy-D-galactose, the immediate precursor of the ECA sugar TDP-Fuc4NAc', 'rffC');
