INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738713', '511145.b3811', '511145', 'site-specific tyrosine recombinase; Site-specific tyrosine recombinase, which acts by catalyzing the cutting and rejoining of the recombining DNA molecules. Binds cooperatively to specific DNA consensus sequences that are separated from xerD binding sites by a short central region, forming the heterotetrameric xerC-xerD complex that recombines DNA substrates. The complex is essential to convert dimers of the bacterial chromosome into monomers to permit their segregation at cell division. It also contributes to the segregational stability of plasmids at ColE1 xer (or cer) and pSC101 (or [...] ', 'xerC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738714', '511145.b3812', '511145', 'FMN phosphatase', 'yigB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738715', '511145.b3813', '511145', 'DNA-dependent ATPase I and helicase II; Has both ATPase and helicase activities. Unwinds DNA duplexes with 3'' to 5'' polarity with respect to the bound strand and initiates unwinding most effectively when a single-stranded region is present. Involved in the post-incision events of nucleotide excision repair and methyl-directed mismatch repair', 'mutU');
