INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738722', '511145.b3822', '511145', 'ATP-dependent DNA helicase; Involved in the recF recombination pathway; its gene expression is under the regulation of the SOS system. It is a DNA helicase', 'recQ');
