INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738728', '511145.b3828', '511145', 'DNA-binding transcriptional activator, homocysteine-binding; Control of the last step in methionine biosynthesis; metR is a positive activator of the metA, metE and metH genes. metR is also a negative regulator of its own expression. Binds homocysteine as an inducer', 'metR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738729', '511145.b3829', '511145', '5-methyltetrahydropteroyltriglutamate- homocysteine S-methyltransferase; Catalyzes the transfer of a methyl group from 5- methyltetrahydrofolate to homocysteine resulting in methionine formation', 'metE');
