INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738733', '511145.b3833', '511145', 'bifunctional 2-octaprenyl-6-methoxy-1,4-benzoquinone methylase/ S-adenosylmethionine:2-DMK methyltransferase; Methyltransferase required for the conversion of dimethylmenaquinone (DMKH2) to menaquinone (MKH2) and the conversion of 2-polyprenyl-6-methoxy-1,4-benzoquinol (DDMQH2) to 2-polyprenyl-3-methyl-6-methoxy-1,4-benzoquinol (DMQH2)', 'ubiE');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738734', '511145.b3834', '511145', 'conserved protein', 'yigP');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738735', '511145.b3835', '511145', '2-octaprenylphenol hydroxylase; Required, probably indirectly, for the hydroxylation of 2-octaprenylphenol to 2-octaprenyl-6-hydroxy-phenol, the fourth step in ubiquinone biosynthesis. Specific for aerobically grown log-phase cells', 'ubiB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738736', '511145.b3836', '511145', 'TatABCE protein translocation system subunit; Required for correct localization of precursor proteins bearing signal peptides with the twin arginine conserved motif S/T-R-R-X-F-L-K. This sec-independent pathway is termed TAT for twin-arginine translocation system. This system mainly transports proteins with bound cofactors that require folding prior to export. TatA seems to form the protein-conducting channel of the TAT system', 'tatA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738737', '511145.b3838', '511145', 'TatABCE protein translocation system subunit; Required for correct localization of precursor proteins bearing signal peptides with the twin arginine conserved motif S/T-R-R-X-F-L-K. This sec-independent pathway is termed TAT for twin-arginine translocation system. This system mainly transports proteins with bound cofactors that require folding prior to export', 'tatB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738738', '511145.b3839', '511145', 'TatABCE protein translocation system subunit; Required for correct localization of precursor proteins bearing signal peptides with the twin arginine conserved motif S/T-R-R-X-F-L-K. This sec-independent pathway is termed TAT for twin-arginine translocation system. This system mainly transports proteins with bound cofactors that require folding prior to export (By similarity)', 'tatC');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738739', '511145.b3842', '511145', 'DNA-binding transcriptional antiterminator; Transcriptional activator of hemolysin synthesis and secretion, also required for expression of sex factor and lipopolysaccharide biosynthesis genes. Transcriptional activator of rfaD/htrM and htrL', 'rfaH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738740', '511145.b3843', '511145', '3-octaprenyl-4-hydroxybenzoate decarboxylase; Catalyzes the decarboxylation of 3-octaprenyl-4-hydroxy benzoate to 2-octaprenylphenol', 'ubiD');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738741', '511145.b3844', '511145', 'flavin reductase; Catalyzes the reduction of soluble flavins by reduced pyridine nucleotides. Seems to reduces the complexed Fe(3+) iron of siderophores to Fe(2+), thus releasing it from the chelator', 'fre');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738742', '511145.b3845', '511145', '3-ketoacyl-CoA thiolase (thiolase I); Catalyzes the final step of fatty acid oxidation in which acetyl-CoA is released and the CoA ester of a fatty acid two carbons shorter is formed. Involved in the aerobic and anaerobic degradation of long-chain fatty acids', 'fadA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738743', '511145.b3846', '511145', 'fused 3-hydroxybutyryl-CoA epimerase/delta(3)-cis-delta(2)-trans-enoyl-CoA isomerase/enoyl-CoA hydratase/3-hydroxyacyl-CoA dehydrogenase; Catalyzes the formation of an hydroxyacyl-CoA by addition of water on enoyl-CoA. Also exhibits 3-hydroxyacyl-CoA epimerase and 3-hydroxyacyl-CoA dehydrogenase activities. Involved in the aerobic and anaerobic degradation of long-chain fatty acids', 'fadB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738744', '511145.b3847', '511145', 'proline dipeptidase; Splits dipeptides with a prolyl residue in the C- terminal position and a polar or nonpolar amino acid at the N- terminal position. With much lower efficiency, also catalyzes the stereoselective hydrolysis of a wide variety of organophosphate triesters and organophosphonate diesters. Is able to hydrolyze the organophosphorus insecticide paraoxon and the p-nitrophenyl analogs of the nerve agents GB (sarin), GD (soman), GF, Vx and rVX', 'pepQ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738745', '511145.b3848', '511145', 'predicted elongation factor', 'yigZ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738746', '511145.b3849', '511145', 'potassium transporter; Low-affinity potassium transport system. Interacts with trk system potassium uptake protein trkA and requires trkE for transport activity', 'trkH');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738747', '511145.b3850', '511145', 'protoporphyrin oxidase, flavoprotein; Catalyzes the 6-electron oxidation of protoporphyrinogen-IX to form protoporphyrin-IX. Does not use oxygen directly. Is coupled to the respiratory chain', 'hemG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738748', '511145.b3856', '511145', 'molybdopterin-guanine dinucleotide biosynthesis protein B; May bind the guanine nucleotide required for the synthesis of molybdopterin guanine dinucleotide', 'mobB');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738749', '511145.b3857', '511145', 'molybdopterin-guanine dinucleotide synthase; Links a guanosine 5''-phosphate to molydopterin (MPT) forming molybdopterin guanine dinucleotide (MGD) (By similarity)', 'mobA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738750', '511145.b3858', '511145', 'conserved protein', 'yihD');
