INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738752', '511145.b3860', '511145', 'periplasmic protein disulfide isomerase I; Required for disulfide bond formation in some periplasmic proteins such as phoA or ompA. Acts by transferring its disulfide bond to other proteins and is reduced in the process. DsbA is reoxidized by dsbB. It is required for pilus biogenesis', 'dsbA');
