INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738755', '511145.b3863', '511145', 'fused DNA polymerase I 5''->3'' polymerase/3''->5'' exonuclease/5''->3'' exonuclease; In addition to polymerase activity, this DNA polymerase exhibits 3'' to 5'' and 5'' to 3'' exonuclease activity. It is able to utilize nicked circular duplex DNA as a template and can unwind the parental DNA strand from its template', 'polA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4739282', '511145.b4485', '511145', 'predicted sugar transporter subunit: ATP-binding component of ABC superfamily', 'ytfR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738756', '511145.b3865', '511145', 'GTP-binding protein; Necessary for normal cell division and for the maintenance of normal septation. Depletion of this protein leads to a severe reduction in growth rate and to extensive filamentation, with a block beyond the stage of segregation. Essential for bacteria survival', 'engB');
