INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738759', '511145.b3868', '511145', 'fused DNA-binding response regulator in two-component regulatory system with GlnL: response regulator/sigma54 interaction protein; Member of the two-component regulatory system ntrB/ntrC involved in the activation of nitrogen assimilatory genes such as glnA. NtrC is phosphorylated by ntrB and interacts with sigma-54', 'glnG');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738760', '511145.b3869', '511145', 'sensory histidine kinase in two-component regulatory system with GlnG; NtrB acts as a signal transducer which responds to the nitrogen level of cell and modulates the activity of ntrC. In nitrogen limitation ntrB activates ntrC by phosphorylating it, while in nitrogen excess ntrC is dephosphorylated and consequently inactivated by ntrB', 'glnL');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738761', '511145.b3870', '511145', 'glutamine synthetase', 'glnA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738762', '511145.b3871', '511145', 'GTP-binding protein; Probably interacts with the ribosomes in a GTP dependent manner. GTPase that mediates interactions between enteropathogenic E.coli (EPEC) and epithelial cells', 'typA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738763', '511145.b3872', '511145', 'predicted DNA-binding transcriptional regulator', 'yihL');
