INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738802', '511145.b3911', '511145', 'sensory histidine kinase in two-component regulatory system with CpxR; This protein is involved in several diverse cellular processes, such as the functioning of acetohydroxyacid synthetase I, in the biosynthesis of isoleucine and valine, the traJ protein activation activity for tra gene expression in F plasmid, and the synthesis, translocation, or stability of cell envelope proteins. Activates cpxR by phosphorylation', 'cpxA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738803', '511145.b3912', '511145', 'DNA-binding response regulator in two-component regulatory system with CpxA; Member of the two-component regulatory system cpxA/cpxR. This system combats a variety of extracytoplasmic protein-mediated toxicities. It performs this function by increasing the synthesis of the periplasmic protease, degP as well as that of cpxP protein', 'cpxR');
