INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738819', '511145.b3930', '511145', '1,4-dihydroxy-2-naphthoate octaprenyltransferase; Conversion of 1,4-dihydroxy-2-naphthoate (DHNA) to dimethylmenaquinone (DMK). Attaches octaprenylpyrophosphate, a membrane-bound 40-carbon side chain to DHNA. The conversion of DHNA to DMK proceeds in three stages: the removal of the carboxyl group of DHNA as CO(2), the attachment of the isoprenoid side chain, and a quinol-to-quinone oxidation, which is thought to be spontaneous', 'menA');
