INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738824', '511145.b3935', '511145', 'Primosome factor n'' (replication factor Y); Recognizes a specific hairpin sequence on phiX ssDNA. This structure is then recognized and bound by proteins priB and priC. Formation of the primosome proceeds with the subsequent actions of dnaB, dnaC, dnaT and primase. PriA then functions as a helicase within the primosome', 'priA');
