INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738834', '511145.b3945', '511145', 'glycerol dehydrogenase, NAD; Catalyzes the NAD-dependent oxidation of glycerol to dihydroxyacetone (glycerone). Allows microorganisms to utilize glycerol as a source of carbon under anaerobic conditions. In E.coli, an important role of gldA is also likely to regulate the intracellular level of dihydroxyacetone by catalyzing the reverse reaction, i.e. the conversion of dihydroxyacetone into glycerol. Possesses a broad substrate specificity, since it is also able to oxidize 1,2-propanediol and to reduce glycolaldehyde, methylglyoxal and hydroxyacetone into ethylene glycol, lactaldehyde a [...] ', 'gldA');
