INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738849', '511145.b3961', '511145', 'DNA-binding transcriptional dual regulator; Hydrogen peroxide sensor. Activates the expression of a regulon of hydrogen peroxide-inducible genes such as katG, gor, ahpC, ahpF, oxyS (a regulatory RNA), dps, fur and grxA. OxyR expression is negatively autoregulated by binding to a 43 bp region upstream of its own coding sequence. OxyR is inactivated by reduction of its essential disulfide bond by the product of grxA, itself positively regulated by OxyR. Has also a positive regulatory effect on the production of surface proteins that control the colony morphology and auto-aggregation ability', 'oxyR');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738850', '511145.b3962', '511145', 'pyridine nucleotide transhydrogenase, soluble; Conversion of NADPH, generated by peripheral catabolic pathways, to NADH, which can enter the respiratory chain for energy generation', 'sthA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738851', '511145.b3963', '511145', 'DNA-binding transcriptional repressor; Represses the transcription of fabB, involved in unsaturated fatty acid (UFA) biosynthesis. By controlling UFA production, fabR directly influences the physical properties of the membrane bilayer', 'fabR');
