INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738862', '511145.b3983', '511145', '50S ribosomal subunit protein L11; This protein binds directly to 23S ribosomal RNA. Forms the L11 stalk, which is mobile in the ribosome, indicating its contribution to the activity of initiation, elongation and release factors', 'rplK');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738955', '511145.b4081', '511145', 'predicted multidrug efflux system component; Could be involved in resistance to puromycin, acriflavine and tetraphenylarsonium chloride', 'mdtO');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738863', '511145.b3984', '511145', '50S ribosomal subunit protein L1; One of the primary rRNA binding proteins, it binds very close to the 3''-end of the 23S rRNA. Forms part of the L1 stalk. It is often not seen in high-resolution crystal structures, but can be seen in cryo_EM and 3D reconstruction models. These indicate that the distal end of the stalk moves by approximately 20 angstroms (PubMed:12859903). This stalk movement is thought to be coupled to movement of deacylated tRNA into and out of the E site, and thus to participate in tRNA translocation (PubMed:12859903). Contacts the P and E site tRNAs', 'rplA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738864', '511145.b3985', '511145', '50S ribosomal subunit protein L10; Protein L10 is also a translational repressor protein. It controls the translation of the rplJL-rpoBC operon by binding to its mRNA', 'rplJ');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738865', '511145.b3986', '511145', '50S ribosomal subunit protein L7/L12; Seems to be the binding site for several of the factors involved in protein synthesis and appears to be essential for accurate translation', 'rplL');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738866', '511145.b3987', '511145', 'RNA polymerase, beta subunit; DNA-dependent RNA polymerase catalyzes the transcription of DNA into RNA using the four ribonucleoside triphosphates as substrates (By similarity)', 'rpoB');
