INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738882', '511145.b4003', '511145', 'sensory histidine kinase in two-component regulatory system with ZraR; Member of the two-component regulatory system zraS/zraR. May function as a membrane-associated protein kinase that phosphorylates zraR in response to high concentrations of zinc or lead in the medium', 'zraS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738883', '511145.b4004', '511145', 'fused DNA-binding response regulator in two-component regulatory system with ZraS: response regulator/sigma54 interaction protein; Member of the two-component regulatory system zraS/zraR. When activated by zraS it acts in conjunction with sigma-54 to regulate the expression of zraP. Positively autoregulates the expression of the zraSR operon', 'zraR');
