INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738911', '511145.b4036', '511145', 'maltose outer membrane porin (maltoporin); Involved in the transport of maltose and maltodextrins, indispensable for translocation of dextrins containing more than three glucosyl moieties. A hydrophobic path ("greasy slide") of aromatic residues serves to guide and select the sugars for transport through the channel. Also acts as a receptor for several bacteriophages including lambda', 'lamB');
