INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738915', '511145.b4041', '511145', 'glycerol-3-phosphate O-acyltransferase; Catalyzes the transfer of an acyl group from acyl-ACP to glycerol-3-phosphate (G3P) to form lysophosphatidic acid (LPA). This enzyme can utilize either acyl-CoA or acyl-ACP as the fatty acyl donor', 'plsB');
