INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738917', '511145.b4043', '511145', 'DNA-binding transcriptional repressor of SOS regulon; Represses a number of genes involved in the response to DNA damage (SOS response), including recA and lexA. Binds to the 16 bp palindromic sequence 5''-CTGTATATATATACAG-3''. In the presence of single-stranded DNA, recA interacts with lexA causing an autocatalytic cleavage which disrupts the DNA-binding part of lexA, leading to derepression of the SOS regulon and eventually DNA repair', 'lexA');
