INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738929', '511145.b4055', '511145', 'acid phosphatase/phosphotransferase, class B, non-specific; Dephosphorylates several organic phosphomonoesters and catalyzes the transfer of low-energy phosphate groups from phosphomonoesters to hydroxyl groups of various organic compounds. Preferentially acts on aryl phosphoesters. Might function as a broad-spectrum dephosphorylating enzyme able to scavenge both 3''- and 5''-nucleotides and also additional organic phosphomonoesters', 'aphA');
