INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738932', '511145.b4058', '511145', 'ATPase and DNA damage recognition protein of nucleotide excision repair excinuclease UvrABC; The UvrABC repair system catalyzes the recognition and processing of DNA lesions. UvrA is an ATPase and a DNA-binding protein. A damage recognition complex composed of 2 uvrA and 2 uvrB subunits scans DNA for abnormalities. When the presence of a lesion has been verified by uvrB, the uvrA molecules dissociate (By similarity)', 'uvrA');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738933', '511145.b4059', '511145', 'single-stranded DNA-binding protein; This protein is essential for replication of the chromosomes and its single-stranded DNA phages. It is also involved in DNA recombination and repair', 'ssb');
