INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738936', '511145.b4062', '511145', 'DNA-binding transcriptional dual regulator; Transcriptional activator of the superoxide response regulon of E.coli that includes at least 10 genes such as sodA, nfo, zwf and micF. Binds the DNA sequence 5''-GCACN(7)CAA-3''. It also facilitates the subsequent binding of RNA polymerase to the micF and the nfo promoters', 'soxS');
INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4738937', '511145.b4063', '511145', 'DNA-binding transcriptional dual regulator, Fe-S center for redox-sensing; Activates the transcription of the soxS gene which itself controls the superoxide response regulon. SoxR contains a 2Fe-2S iron-sulfur cluster that may act as a redox sensor system that recognizes superoxide. The variable redox state of the Fe-S cluster is employed in vivo to modulate the transcriptional activity of soxR in response to specific types of oxidative stress. Upon reduction of 2Fe-2S cluster, SoxR reversibly loses its transcriptional activity, but retains its DNA binding affinity', 'soxR');
