INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4739159', '511145.b4310', '511145', 'conserved protein; Converts alpha-N-acetylneuranimic acid (Neu5Ac) to the beta-anomer, accelerating the equilibrium between the alpha- and beta-anomers. Probably facilitates sialidase-negative bacteria to compete sucessfully for limited amounts of extracellular Neu5Ac, which is likely taken up in the beta-anomer. In addition, the rapid removal of sialic acid from solution might be advantageous to the bacterium to damp down host responses', 'nanM');
