INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4739161', '511145.b4312', '511145', 'tyrosine recombinase/inversion of on/off regulator of FimA; FimB is one of the 2 regulatory proteins which control the phase variation of type 1 fimbriae in E.coli. These proteins mediate the periodic inversion of a 300bp DNA segment that harbors the promoter for the fimbrial structural gene, fimA. FimB switches fimA on', 'fimB');
