INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4739163', '511145.b4314', '511145', 'major type 1 subunit fimbrin (pilin); Fimbriae (also called pili), polar filaments radiating from the surface of the bacterium to a length of 0.5-1.5 micrometers and numbering 100-300 per cell, enable bacteria to colonize the epithelium of specific host organs', 'fimA');
