INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4739190', '511145.b4346', '511145', '5-methylcytosine-specific restriction enzyme McrBC, subunit McrB; Recognizes N4- and C5-methylcytosine (and 5-hydroxy- methylcytosines) produced by a broad range of DNA methylases and appears to act against 5-methylcytosine preceded by a purine residue. Binds to DNA containing methylated cytosines; also binds to GTP. Isoform 33 kDa is less active than isoform 51 kDa and may play a role in regulating the activity of isoform 51 kDa by competing with it in DNA and protein binding abilities', 'mcrB');
