INSERT INTO proteins(protein_id, protein_external_id, species_id, annotation, preferred_name) VALUES('4739192', '511145.b4348', '511145', 'specificity determinant for HsdM and HsdR; The M and S subunits together form a methyltransferase (MTase) that methylates two adenine residues in complementary strands of a bipartite DNA recognition sequence. In the presence of the R subunit the complex can also act as an endonuclease, binding to the same target sequence but cutting the DNA some distance from this site. Whether the DNA is cut or modified depends on the methylation state of the target sequence. When the target site is unmodified, the DNA is cut. When the target site is hemimethylated, the complex acts as a maintenance M [...] ', 'hsdS');
